赔的，用户应全额补偿本站一切费用(包括但不限于各种赔偿费、诉讼代理费及为此支出的其它合理费用)；&nbsp;<br />4.4 当第三方认为用户发表或者上传于本站的信息侵犯其权利，并根据《信息网络传播权保护条例》或者相关法律规定向本站发送权利通知书时，用户同意本站可以自行判断决定删除涉嫌侵权信息，除非用户提交书面证据材料排除侵权的可能性，本站将不会自动恢复上述删除的信息；(1)不得为任何非法目的而使用网络服务系统；&nbsp;<br />(2)遵守所有与网络服务有关的网络协议、规定和程序； (3)不得利用本站进行任何可能对互联网的正常运转造成不利影响的行为；&nbsp;<br />(4)不得利用本站进行任何不利于本站的行为。4.5 如用户在使用网络服务时违反上述任何规定，本站有权要求用户改正或直接采取一切必要的措施(包括但不限于删除用户张贴的内容、暂停或终止用户使用网络服务的权利)以减轻用户不当行为而造成的影响。</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<h4>五、隐私保护</h4>\n<p>5.1 本站不对外公开或向第三方提供单个用户的注册资料及用户在使用网络服务时存储在本站的非公开内容，但下列情况除外：(1)事先获得用户的明确授权；&nbsp;<br />(2)根据有关的法律法规要求；<br />(3)按照相关政府主管部门的要求；<br />(4)为维护社会公众的利益。5.2 本站可能会与第三方合作向用户提供相关的网络服务，在此情况下，如该第三方同意承担与本站同等的保护用户隐私的责任，则本站有权将用户的注册资料等提供给该第三方。<br />5.3 在不透露单个用户隐私资料的前提下，本站有权对整个用户数据库进行分析并对用户数据库进行商业上的利用。</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<h4>六、版权声明</h4>\n<p>6.1 本站的文字、图片、音频、视频等版权均归永兴元科技有限公司享有或与作者共同享有，未经本站许可，不得任意转载。&nbsp;<br />6.2 本站特有的标识、版面设计、编排方式等版权均属永兴元科技有限公司享有，未经本站许可，不得任意复制或转载。&nbsp;<br />6.3 使用本站的任何内容均应注明&ldquo;来源于保宝网&rdquo;及署上作者姓名，按法律规定需要支付稿酬的，应当通知本站及作者及支付稿酬，并独立承担一切法律责任。<br />6.4 本站享有所有作品用于其它用途的优先权，包括但不限于网站、电子杂志、平面出版等，但在使用前会通知作者，并按同行业的标准支付稿酬。<br />6.5 本站所有内容仅代表作者自己的立场和观点，与本站无关，由作者本人承担一切法律责任。&nbsp;<br />6.6 恶意转载本站内容的，本站保留将其诉诸法律的权利。</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<h4>七、责任声明</h4>\n<p>7.1 用户明确同意其使用本站网络服务所存在的风险及一切后果将完全由用户本人承担，保宝网对此不承担任何责任。&nbsp;<br />7.2 本站无法保证网络服务一定能满足用户的要求，也不保证网络服务的及时性、安全性、准确性。&nbsp;<br />7.3 本站不保证为方便用户而设置的外部链接的准确性和完整性，同时，对于该等外部链接指向的不由本站实际控制的任何网页上的内容，本站不承担任何责任。<br />7.4 对于因不可抗力或本站不能控制的原因造成的网络服务中断或其它缺陷，本站不承担任何责任，但将尽力减少因此而给用户造成的损失和影响。<br />7.5 对于站向用户提供的下列产品或者服务的质量缺陷本身及其引发的任何损失，本站无需承担任何责任：(1)本站向用户免费提供的各项网络服务；&nbsp;<br />(2)本站向用户赠送的任何产品或者服务。7.6 本站有权于任何时间暂时或永久修改或终止本服务(或其任何部分)，而无论其通知与否，本站对用户和任何第三人均无需承担任何责任。</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<h4>八、附则</h4>\n<p>8.1 本协议的订立、执行和解释及争议的解决均应适用中华人民共和国法律。&nbsp;<br />8.2 如本协议中的任何条款无论因何种原因完全或部分无效或不具有执行力，本协议的其余条款仍应有效并且有约束力。<br />8.3 本协议解释权及修订权归深圳永兴元科技有限公司所有。</p>', 'javawww', '400-123654', '共赢天下', 'http://www.xyz.com', '张三丰', '13825456620', '深圳共赢贷款网络有线公司', '阿斯顿发生', 'https://oss.ywq157.com/app/1560410169241.png', '1', '0', '8', '2019-06-09 00:52:04', '2019-06-18 15:50:40');
