INSERT INTO `chamber_info` VALUES ('437df45480698693514f0c5d3803ca08', 'ff889b57a1ba4d6efc3b8cea56b5d2a4', '1', '22.65079', '114.19458', '广东省深圳市龙岗区四联社区富利时路3号2013创业谷', '广东省深圳市龙岗区四联社区富利时路3号2013创业谷5栋3楼3019', '陈满华', '13923785880', '13923785880', null, '<p><img class=\"wscnph\" src=\"https://oss.ywq157.com/diquan/1555593492395.png\" /></p>\n<p><br /> </p>\n<p>彭泽县位于江西省最北部，长江中下游南岸，与皖交界，素有&ldquo;七省扼塞&rdquo;&ldquo;赣北大门&rdquo;之称，总面积1544平方公里，人口38万。彭泽是千年古县，始建于汉高祖六年（公元前201年）。这里山川秀美，人杰地灵，历史名人陶渊明、狄仁杰先后在此任过县令。</p>\n<p>&nbsp;</p>\n<p>长期以来，深圳作为我国改革开放的前沿和经济发展的排头兵，吸引了众多彭泽籍能人志士前往深圳投资创业，经过多年的打拼、积累和沉淀，造就了一大批以深圳市裕同包装科技股份有限公司（股票代码：002831）为典型代表的优秀企业。截止目前，据不完全统计在深发展的彭泽籍企业家就有近千人，为推动深圳经济发展作出了积极贡献。为了进一步加强在深彭泽籍人士的联系与交流，促进团结协作，资源共享，实现共同发展，同时也为了更好增进深圳、彭泽两地在经济、文化等方面的交流合作，2017年11月份以深圳建邦建设有限公司等为主要单位发起成立深圳市江西彭泽商会。</p>\n<p>根据《广东省民政厅关于异地商会登记的管理办法》，在家乡各级政府的关怀、领导下，经深圳市民政局批准，深圳市江西彭泽商会于2018年3月8日正式成立。</p>\n<p>&nbsp;</p>\n<p>深圳市江西彭泽商会是由在深圳、东莞、惠州、佛山、中山等粤港澳大湾区的彭泽籍企业界人士自愿组成的非营利性社会团体，是粤港澳大湾区的彭泽籍企业家与深圳、彭泽两地政府沟通，企业家之间相互交流、互助合作的平台，是支持家乡建设、投身公益事业的纽带。</p>\n<p>&nbsp;</p>\n<p>本商会的使命是：&ldquo;以商会为平台，帮助在深彭泽籍企业凝聚乡情、克服困难、深度合作、共同发展，充分发挥政府与企业、企业与企业之间的桥梁和纽带作用。鼓励会员企业在自我发展壮大的同时，通过投资、公益捐助、文化交流等方式，促进深圳、彭泽两地的经济发展和社会进步，为国家繁荣昌盛、构建和谐社会贡献力量。</p>\n<p>&nbsp;</p>\n<p>目前，本商会会员企业近300家，分布在建筑、包装、印刷、化工、新能源、电子、医疗、日化、金融、保险、投资、房地产、通讯、贸易、制造、机电、物流、教育、酒店、家居、餐饮、服装、文化传媒、互联网等诸多行业。商会创会会长单位为深圳建邦建设有限公司（董事长李必旺-定山人），设有常务副会长单位5家、副会长单位12家，常务理事、理事单位40多家。</p>\n<p>商会核心价值观：以信为本，公平公正，自由平等，合作共赢。</p>\n<p>&nbsp;</p>\n<p>商会愿景：成为会员信赖，社会尊重，全国知名的百年商会。</p>\n<p><img class=\"wscnph\" src=\"https://oss.ywq157.com/diquan/1555593513988.jpg\" /></p>', null, 'https://oss.ywq157.com/diquan/1555593370458.jpg', null, null, null, '深圳市江西彭泽商会', 'ff889b57a1ba4d6efc3b8cea56b5d2a4', '2019-04-18 21:10:53', '2019-04-18 21:18:41');
