INSERT INTO `company_info` VALUES ('0124e6083f1f295661bf255c2b5c14a3', '74911ca784bd610cdb6fdb537e42f95e', '1', '2', '22.62312', '114.03898', '朝东远财务', '民康路口民泰大厦', '深圳市龙华区民治街道民康路1号民泰大厦1017', '1', '汪', '光梁', 'https://oss.ywq157.com/diquan/9cqb3cwjjqp.jpg', '汪光梁', null, '', null, '13760455823', '13760455823', null, '注册公司,记账报税,商标注册,公司变更,银行开户,一般纳税人申请,食品经营许可证办理,进出口权办理', '深圳市极之光企业管理有限公司是一家综合商务服务公司，公司成立于2014年08月27日。主要从事国内外公司注册、商标注册、专项服务及后续记帐等配套服务。总部位于深圳市宝安区。\n     专业、诚信是极之光的工作态度； 专注、精致是极之光的工作风格。我们将竭诚为您服务，为您的创业之路保驾护航。期待与您携手共进，同创辉煌。\n     极之光企业文化深厚，服务体系完整，拥有一支经验丰富的专业团队。多年行业经验，锤炼了良好的职业操守和专业水平，能够为国内外客户提供优质、高效的服务。\n \n \n一、服务：综合化\n极之光企业目前涉及三大服务领域：公司注册营运服务、知识产权保护服务、金融服务。具备了从“企业成立的流程操作”，至“知识产权保护”，再到“企业品牌建设及推广”一整条完整服务项目链条，解决了客户多种类需求。\n \n二、技能：专业化\n我们的行业与政府政策、法律法规、经济走势息息相关，而这些都随时存在变数。因此，标杆企业专门组建了“政策研究中心”，负责公司的服务项目开发、服务标准制定，并为承担公司专业顾问的培训和指导工作。我们现有一批专业顾问，和从业近十年的行业专家，能够为客户提供准确、权威的服务。\n \n三、操作：流程化\n极之光企业按照现代企业制度构建公司组织架构，公司设有业务系统、财务系统、售后系统、策略系统、管理系统。是行业中少有具备从咨询、合同、文件制作、文件递交的流水线作业的企业。从根本上保证了客户信息保密、操作规范、文件安全。\n \n \n服务领域：\n1. 公司注册：\n深圳公司注册、前海公司注册、香港公司注册、美国公司注、海外公司注册等\n2. 知识产权：\n中国商标注册、香港商标注册、海外商标注册、专利申请、著作权申请。\n3. 专项服务：\n记帐报税、公司年审、银行开户、律师见证、资助补贴。\n4. 后续服务：\n公司变更、商标变更、进出口权申请、一般纳税人申请、网站建设。\n \n联系人：程小姐  13631594102', '深圳市极之光企业管理有限公司', 'https://www.7utor.cn/app/20181217115204-919955.jpg', 'https://www.7utor.cn/diquan/96mzfnlzqwi.jpg', null, null, null, '1', '2018-12-17 03:52:18', '2019-04-02 13:06:48');
