INSERT INTO `company_info` VALUES ('12ce1f713e1726dfb08759c43db14932', '7c944e02801f5fe08aeb844fc93e3b47', '1', '2', '22.65368', '114.19125', '鑫德激光', '四联路398号7楼', '深圳市龙岗区横岗街道四联路412号7楼', '1', '娄', '生', 'https://oss.ywq157.com/diquan/tv3x555bbd.jpg', '娄生', '', '', '', '13724351066', '13724351066', '', '激光打标机|激光焊接机|激光切割机|激光镭射|激光设备', '鑫德（深圳）激光设备有限公司是一家集研发、制造、销售工业激光设备为一体的高新技术企业，为客户节约成本、量身打造一流的设备，公司生产基地位于广东省深圳市龙岗区横岗，旗下涵括标准激光设备及非标自动化激光设备的生产和销售两大体系。目前，公司拥有大批富于挑战高科技理念和创新敬业精神的新型人才，在激光技术研发和应用领域，一直处于领先地位。生产实时数据监控管理流程，现场资源追踪，确保产品质量拥有自动化核心团队生产实时数据监控管理流程，现场资源追踪，确保产品质量拥有自动化核心团队，为客户量身定制非标设备.技术点对点的培训、保养、及设备故障维修、工艺调试，可根据客户需求提供各种非标自动化在线激光设备\n公司主要产品包括激光焊接机系列：（YAG激光自动焊接机，光钎传输焊接机，振镜激光焊接机，激光焊接机器人，聚合物电池自动焊生产线，18650铝壳PACK生产线）；激光打标系列：（光钎，紫外，CO2，绿光，视觉跟踪定位激光打标机），等生产和销售20多种型号的工业激光设备。其产品性能稳定，操作维护简便，在同类产品中占有很高的性价比。为国内外多家大型企业提供了完善的激光设备应用解决方案，并且部分产品远销加拿大、美国、日本、韩国、越南、伊朗、印尼等国家。\n产品广泛应用于电子、IC芯片、电工电器、照明灯具、珠宝首饰、五金工具、卫浴洁具、仪表仪器、汽摩配件、手机通讯部件、五金模具、精密器械、医疗器械、集成电路、IT电子产品、数码金属部件、军工航空部件、服装服饰皮革、餐饮炊具、工艺礼品、广告装饰，动力电池等众多金属与非金属领域。', '鑫德(深圳)激光设备有限公司', '', '', 'https://oss.ywq157.com/diquan/odgp2a747o9.jpg|https://oss.ywq157.com/diquan/52k33s26ru8.jpg|https://oss.ywq157.com/diquan/o9s7ok7dhxl.jpg|https://oss.ywq157.com/diquan/pk3ldghquv.jpg|https://oss.ywq157.com/diquan/kq41ium5is.jpg|https://oss.ywq157.com/diquan/g8rralv3kab.jpg|https://oss.ywq157.com/diquan/zhwrzbsd4.jpg|https://oss.ywq157.com/diquan/gjjnc699kg.jpg', 'WWW. SZXDLASER.COM  WWW.SZXDLASER.CN', null, '1', '2019-02-20 08:31:06', '2019-02-20 09:39:21');
