INSERT INTO `company_info` VALUES ('1331d64e72b56d7da5b2758a07be131e', 'af358c35aacd440ae77e3beb1eb4b521', '0', '0', '22.69026', '113.98382', null, '广东省深圳市龙华区华宁路40号', '深圳市龙华区大浪华宁路港深创新园G栋六楼609-609', '2', '甘', '少玲', 'https://oss.ywq157.com/diquan/k0sd256ujbt.jpg', '甘少玲', '', null, null, '18814352587/18174880770', '4001881878', 'https://oss.ywq157.com/diquan/sj2jup04se.jpg', '', '深圳市圆周检测技术有限公司总部位于深圳市龙华区，总部与实验室总占地面积约1000多平方米。圆周检测是一家综合性、专业性、国际性的工业与消费产品第三方测试、检验与验证服务机构，其核心技术源自德国五大实验室之一的emitel-AG公司。公司自成立以来，一直从事产品安全、电磁兼容（EMC）的测试与认证、化学检验与材料分析、电子电器产品有毒物质（RoHS）检验、可靠性测试、标准研究、产品EMC设计与对策、各国认证、ISO体系辅导、技能培训等工作。现拥有国际一流的检测设备、专业的测试团队、技能娴熟的认证辅导团队。公司以竭尽全力为我们的客户提供支持和增加价值为目标，提供全面的检测和认证解决方案，促进客户在国内外市场上的成功，让客户自信地行销世界。圆周检测实验室严格按照ISO/IEC 17025的体系标准进行管理，我们拥有众多经验丰富的业界资深专家、测试与认证工程师及服务代表，可为广大厂商提供认证申请、标准咨询、产品测试、技术支持、对策等“一站式”服务。通过我们的努力，您可以在最短的时间内获得最广泛的国际认证。服务产品范围包括信息技术类、家电类、灯具类、电动工具类、广播电视音响类，工业、科学、医疗类，汽车电子、无线射频产品等。同时代理全球大多数知名认证机构的电子产品认证以及机械设备、医疗电子、汽车电子、电子电器有害物质认证。圆周检测目前与众多知名认证机构有良好的合作，并拥有众多的实验室资源，能在第一时间为你提供满意的服务。我们也计划在将来继续引进优秀人才，扩充试验场地、设备和服务范围，为更多的厂商提供更完善的服务。圆周检测凭借人才、技术、信息、检测等方面的强大资源优势和支撑，为企业提供及时的本地化的检验与测试服务，并寻求做好、做专、做大的自身发展之路，赢得了客户的一致信赖', '深圳市圆周检测技术有限公司', 'https://oss.ywq157.com/diquan/p8jdniemae.jpg', 'https://oss.ywq157.com/diquan/oqdhidanrhf.jpg', 'https://oss.ywq157.com/diquan/uz58giy3f6.jpg|https://oss.ywq157.com/diquan/xtuo1nkzrh.jpg|https://oss.ywq157.com/diquan/yo5ao922ib.jpg|https://oss.ywq157.com/diquan/db7y0awengr.jpg|https://oss.ywq157.com/diquan/dm592cgfl4o.jpg|https://oss.ywq157.com/diquan/s882otpwcv.jpg|https://oss.ywq157.com/diquan/qc9my8vsrwh.jpg', 'http://c-cert.com/index.himl', null, '1', '2019-04-18 09:27:02', '2019-04-18 09:40:24');
