INSERT INTO `company_info` VALUES ('14d5707965ec05c27968652423f52688', 'd5ff0f7af95ead624bb2b5b50d3d628c', '1', '2', '22.59931', '113.88476', '馨宁居·休闲生活', '宝田一路西乡街道336号创业楼1层101', '101', '1', '余', '生', 'https://oss.ywq157.com/diquan/w8n5dj4q8p.jpg', '余生', '', '', '', '18926004161', '4007051668', 'https://oss.ywq157.com/diquan/rez325mci1.jpg|https://oss.ywq157.com/diquan/yc0gf6gbwqd.jpg|https://oss.ywq157.com/diquan/m9cah1fdp4.jpg|https://oss.ywq157.com/diquan/8njst4dn8o2.jpg|https://oss.ywq157.com/diquan/1y4nlah3o4.jpg|https://oss.ywq157.com/diquan/4kz6gqt77p.jpg|https://oss.ywq157.com/diquan/zmxk9mc42km.jpg|https://oss.ywq157.com/diquan/hc24ohcrrqu.jpg|https://oss.ywq157.com/diquan/8iahrmat247.jpg|https://oss.ywq157.com/diquan/ux5c05ctoh.jpg', '户外遮阳伞,户外藤编椅子,铸铝椅,铸铝沙发,酒店户外用品,别墅户外家具,公园椅…………', '“深圳市馨宁居户外休闲用品有限公司”、德国“sinlege”休闲家具致力于休闲生活全方位的解决方案。\n“馨宁居”中国总部位于广东省深圳市宝安区西乡七星创意工场。在德国慕尼黑设立的“sinlege”休闲家具（德国）公司主要是以产品研发和欧美市场拓展为主，生产基地位于中国广东佛山，在中国北京设有中国北方区营销体验中心和休闲家具独立体验馆。\n伴随着国内经济的高速发展、酒店房产开发的热浪，休闲旅游度假的蓬勃之势，“馨宁居”2006年在北京设立了国内营销中心，我们致力于将当今优质的产品、新的消费信息介绍给我们的客户，倡导一种健康、自然、时尚的休闲生活方式。“馨宁居”品牌产品涵盖了休闲家具、户外遮阳、庭院休闲配套三大系列近千个品种。形成了集花园休闲理念设计、生产、制造、销售、服务为一体的专业企业。 公司在原有“馨宁居”产品品牌的基础上，先后推出和引进了“诺佰斯”、德国“sinlege”、“森诺杰”、“新邻居”等休闲家具品牌。经过在多年的发展，“馨宁居”企业在地产景观休闲配套、酒店会所休闲、办公休闲、餐饮商业休闲、私家花园休闲等等领域累积了丰富的经验。 先后为“2011深圳大运会、清华大学、北京大学等；酒店有【希尔顿】、【香格里拉】、【宝能桔钓沙】、【中国大饭店】等；房地产有北京金融街、万科、金地地产、华夏幸福孔雀城等；商业街餐饮有太平洋咖啡、美国蓝蛙、三里屯酒吧街、798艺术区等；旅游有抚顺热高乐园、北海公园、华侨城、大连老虎滩海洋公园等；餐饮企业有可口可乐、肯德基、加多宝等；还有众多私人会所别墅花园提供了产品和服务。我们不仅提供时尚高品质的产品，同时也提供优质的售后服务和技术支持，不断地开发设计创新产品，树立品牌，是公司的宗旨。对公司员工提倡自尊、自强、奋斗、学习的企业文化，我们注重与客户进行诚实、公平、相互尊重的真诚交流。\n“馨宁居”公司先后参加了第29、30届深圳国际家具展览会、第9届中国（深圳）国际品牌内衣展览会、第4届/第5届深圳国际家居饰品展览会、第12届中国青岛国际家具及木工机械展览会。公司是深圳时尚创意产业联盟成员单位。在2017广东国际旅游产业博览会暨第十五届广州国际酒店用品展览会获得“最受欢迎酒店家具品牌奖”，还有全国环保会展、奥运成果展览等，均留下了我们的足迹。2017年，深圳市馨宁居户外休闲用品有限公司，在中外酒店业届公认最具公信力的奖项之一——“中外酒店白金奖”评选中，从众多候选家具品牌中脱颖而出，夺得中外酒店（十二届）最佳户外定制家具供应商【白金奖】！\n“馨宁居”公司拥有众多发明和外观专利，并聘请中国知名专利法律师李泽旭作为公司法律专家。公司2015年推出了自己原创专利“空中之城”系列产品。 2015年5月更与美国设计大师汤姆斯.威尔逊（Thmos Wilson）签约，2015年底在德国慕尼黑设立sinlege休闲家具（德国）公司，在自主原创国际化道路更加迈进了一大步。“馨宁居”坚持自己一贯的品牌与创新道路，加快智能家居研发，紧跟时尚步伐，倡导休闲花园生活。 “馨宁居”公司创立伊始便关注环保与时尚休闲二大主题，不仅产品在原材料选用上与各世界知名品牌开展合作，公司logo 即源于“馨宁居”吉祥物“藏羚羊、犴达罕”，通过摄影师镜头下的“犴达罕”，找到了“关注北方少数民族在当下社会的生存状况和精神状态”为主题的知名纪录片导演顾桃作为公司形象代言人，社会的变迁和新的休闲生活方式，通过我们大家一起的述说：“人、动物、自然、社会”，当下的我们更加应该尊崇原始的自然法则，不应该让老去的传说和民族的过往荣耀在风中被遗忘与消散……\n“弘扬工匠精神，创休闲家具百年品牌”，馨宁居人在路上，实现我们一直所追求的：\n“ 品位馨宁，来自心灵的感受!”', '馨宁居', 'https://oss.ywq157.com/diquan/s4g7jzbq9h.jpg', 'https://oss.ywq157.com/diquan/k7yerav7gxq.jpg', 'https://oss.ywq157.com/diquan/72z0mzmf1jt.jpg|https://oss.ywq157.com/diquan/58ngx74jfdo.jpg|https://oss.ywq157.com/diquan/230gkp1ra3h.jpg|https://oss.ywq157.com/diquan/s65wv3yw3i9.jpg|https://oss.ywq157.com/diquan/b91js5j9k3i.jpg', 'www.hwxxjj.com', null, '1', '2019-01-04 08:08:01', '2019-01-04 09:20:32');
