INSERT INTO `company_info` VALUES ('20126f0ab8a444b6d8ad89652c9df828', 'dbb9ec8e0d76fc5ff0c7b3d827f7642e', '1', '2', '22.75301', '114.17038', '', '广东省东莞市黄洞村90正北方向30米', '东莞市凤岗镇金凤凰大道E栋7楼', '1', '温', '龙胜', 'https://oss.ywq157.com/diquan/rt5vrykr3jk.jpg', '温龙胜', 'https://oss.ywq157.com/diquan/ymfgjjqgru.jpg', 'https://oss.ywq157.com/diquan/vcqm0ole7n.jpg', '', '18128585386', '0769-82893916', 'https://oss.ywq157.com/diquan/kam7kpwhow.jpg|https://oss.ywq157.com/diquan/zk2kwrdj4sh.jpg|https://oss.ywq157.com/diquan/d3zgazulxv8.jpg|https://oss.ywq157.com/diquan/dx9h6degk0j.jpg|https://oss.ywq157.com/diquan/z6mf9vxt4ar.jpg|https://oss.ywq157.com/diquan/8qd7yk4tlxt.jpg|https://oss.ywq157.com/diquan/nhpbpbssys8.jpg|https://oss.ywq157.com/diquan/476a432204m.jpg|https://oss.ywq157.com/diquan/44hw3ck69y6.jpg', '亚克力展示架,亚克力相框,亚克力标牌,有机玻璃工艺品', '东莞市华创展示制品有限公司是一家专业设计、加工制作各类有机玻璃(亚克力、亚加力、压克力、Acrylic、Pmma）制品 的工厂。工厂具备目前行业较完善、先进的机械设备，拥有大批从事多年有机玻璃行业的技术精英及工程开发人员，良好的服务态度，经验丰富的技术水准，整洁的生产环境，强大的生产制造能力，全心全意为我们的客户做好服务。\n公司具有先进的开模/喷油/喷砂/丝印/移印/转印/热弯成型/无缝热压/拉丝/磨砂/抛光/激光雕刻切割/激光打标/CNC雕刻等全套生产 设备与技术,所有工艺全部自行完成。厂房面积约2000多平方米。\n公司一直秉承\"规模化、国际化\"的发展方向，逐步成为国内外有口碑的公司之一。产品销往欧美，东南亚和香港、台湾等地 、以价平，重诺，守信赢得海内外客户的好评和认可。追求卓越，迎合时尚，诚信经营，客户为尊。我们愿以自己的丰富经验的水平和不懈的努力，为客户提供满意的产品，真诚 为您服务!在新一轮的市场竞争中，愿与广大客户携手\"双赢\"。\n', '东莞市华创亚克力(有机玻璃)展示制品有限公司', 'https://oss.ywq157.com/diquan/c0g9oc4s9ug.jpg', 'https://oss.ywq157.com/diquan/8l0q2wm16kg.jpg', 'https://oss.ywq157.com/diquan/k44e4q1x3ok.jpg|https://oss.ywq157.com/diquan/ka45s2gfbn.jpg|https://oss.ywq157.com/diquan/txpjb4i6wgr.jpg|https://oss.ywq157.com/diquan/zweride9u2j.jpg|https://oss.ywq157.com/diquan/852mcxwne84.jpg|https://oss.ywq157.com/diquan/zt240m378d.jpg|https://oss.ywq157.com/diquan/z01xevi46ri.jpg', 'www.yakeli168.com', null, '1', '2019-03-16 09:33:50', '2019-03-29 11:05:36');
