INSERT INTO `company_info` VALUES ('217d5daef2d5a2b6f260c83219d39888', '9b7856b7580b405b2f952d4d37cc6ffd', '1', '2', '22.26853', '113.46294', '中山煜兴电子有限公司人民调解委员会', '坦洲镇文苑路8号', '一楼', '1', '李', '定国', 'https://oss.ywq157.com/diquan/pcgt3z75x2n.jpg', '李定国', 'https://oss.ywq157.com/diquan/z51grw3intd.jpg', 'https://oss.ywq157.com/diquan/z8o5bhytsb.jpg', '', '13680283850', '0760-86212568', 'https://oss.ywq157.com/diquan/6e4p7jczhmf.jpg|https://oss.ywq157.com/diquan/vo2jgyzlls.jpg', '网络变压器LAN-Transformer、连接器RJ45-Connector', '炫兴股份有限公司成立于1977年，致力于传统变压器、整流器设计、生产制造、销售一体的企业.随着电脑网络兴起及市场环境需求变化 , 公司于1996年逐步转型设计生产网络相关零件并注册TAIMAG为品牌, 公司坐落于交通便利、环境优雅的台湾高雄，从事生产制造产品主要包括:网络变压器(滤波器)、网络连接器RJ-45、脉冲变压器、DC-DC变压器等.我们通过取ISO9001 、ISO14001认证及国内外知名企业的品质认可，证明我们有良好的质量系统与管理能力，公司拥有经验丰富的研发团队，具有资深专业设计能力及配有先进的分析测试设备，使公司在研发上具有很强的竞争力，研发的产品并已荣获多项专利认证.工厂设立于广东省中山市坦洲镇, 现有员工200人，配备整套网络变压器行业一流的自动化生产设备', '中山煜兴电子有限公司', 'https://oss.ywq157.com/diquan/iundj82jk38.jpg', 'https://oss.ywq157.com/diquan/g7fg1575qwq.jpg', 'https://oss.ywq157.com/diquan/6nrubtxbv3.gif', 'www.taimag.com', null, '1', '2019-01-04 08:51:55', '2019-01-11 15:25:54');
