INSERT INTO `company_info` VALUES ('388ca1503c95c36370f3c3992dc9a143', '08a6fa0a668a8272d393759aa53a3a29', '1', '1', '22.62704', '114.07243', null, '广东省深圳市龙岗区布龙路575号附近', '深圳市龙岗区坂田街道布龙路动车国际大厦701', '0', '刘', '志明', 'https://oss.ywq157.com/diquan/u4soicjp4fd.jpg', '刘志明', 'https://oss.ywq157.com/diquan/ia1rezexb5k.jpg', 'https://oss.ywq157.com/diquan/e5wghdvjxta.jpg', null, '18888754147', '18888754741', 'https://oss.ywq157.com/diquan/z0jqlczhgq.jpg', '电源驱动,驱动IC,品牌MOS,电子元器件', '深圳市华钻电子有限公司【ACT】成立于2004年，位于广东省深圳市，同时还分别下设有中山、宁波和西安分公司，是一家代理及分销国内外各大品牌电元器件的电子科技公司，具有丰富的电子行业经验，所供应的产品应用于LED照明，LED显示，LED电源，LED模组，通讯，无线充电及航天航空电子产品领域。代理及分销品牌有：电源类：菱奇LZC  莱士LIS 芯联CL 台湾绿达GR  泉芯QX 亚成微RM无线充类：易冲无线，劲芯微  航顺芯，华润军工类：MAGIC （瑞典）容阻：ZZEC CBBMOS：士兰，华晶，新洁能本公司自成立以来一直致力为各大照明灯饰厂家，电子电器设备厂家提供进口正品原装的电子元器件，公司有着优秀的营销队伍和国内各区域渠道合作伙伴，对于产品的市场开拓和售前售后服务，产品设计方案等方面有着健全的配套管理。销售网络遍布全国，先进、完善的销售服务理念，使得我们在电子行业中享有良好的信誉，并且组建了非常完整的供应体系，以优惠的价格，可靠的质量，一流的服务赢得了客户的好评与长期合作。同时我们将一如既往的秉承“诚信，服务，创新，共赢”的经营理念，以客户满意为原则，竭诚为我们每一个客户提供最好的产品和最优质的服务。我公司长期备有大量热门产品库存，欢迎随时来电来函洽谈！    ', '深圳市华钻电子有限公司', 'https://oss.ywq157.com/diquan/36nfm12r9yy.jpg', 'https://oss.ywq157.com/diquan/83hk3gta6mn.jpg', 'https://oss.ywq157.com/diquan/gak5lzsn74e.jpg', 'http://www.ideaact.com', null, '1', '2019-04-12 13:45:53', '2019-04-12 14:19:57');
