INSERT INTO `company_info` VALUES ('4a1ea2c93fa83bf18e4fcf5adbf25f25', 'd3027d6bf9e59be818d3fe525b6b3b82', '1', '2', '22.63662', '114.08843', '', '广东省深圳市龙岗区吉华路399号', '深圳市吉华路399号红门科技园一期D栋403', '1', '刘', '钧华', 'https://oss.ywq157.com/diquan/4qyo30o9qbi.jpg', '刘钧华', 'https://oss.ywq157.com/diquan/31twp1gk0rz.jpg', '', '', '13422988646', '13422988646', 'https://oss.ywq157.com/diquan/xcqx4ba48ds.jpg|https://oss.ywq157.com/diquan/kt3yivyw9j.jpg|https://oss.ywq157.com/diquan/knj3pffm0pk.jpg|https://oss.ywq157.com/diquan/2zzmgkkzg5i.jpg|https://oss.ywq157.com/diquan/sdmrprifqal.jpg|https://oss.ywq157.com/diquan/uzmiz21ju.jpg|https://oss.ywq157.com/diquan/f81frjpnypl.jpg|https://oss.ywq157.com/diquan/n0vs1504fd.jpg|https://oss.ywq157.com/diquan/7dhav2ghi9u.jpg', '智能锁  指纹锁', '深圳市爱的芯科技有限公司是一家专业从事智能防盗锁研发、设计、验证、生产、销售和技术服务为一体的高科技产业公司。公司以美国领先国际的研发技术为依托，综合电子、数字、电磁感应、微电机、远程遥控、生物信息识别、网络及云计算等高新科技，研发生产接触式感应、非接触式感应、密码、指纹、人脸识别、虹膜识别等多种方式结合的个性化智能防盗锁，现已进入国内外市场，我们的目标是“爱的芯锁住你我心”，让全球大众均熟知“爱的芯”品牌。  \n  爱的芯智能防盗锁在产品外观和人性化功能设计上，特别注重消费者的审美风格及应用体验，从而实现“理性奢华”的产品理念。目前产品无论在外观设计、机械结构、电子功能，还是软件开发，都受到广大消费者的普遍青睐。外观流畅、高雅华贵，既能彰显古典的显赫，又能突显现代的优雅。锁体采用实心金属材料一铸成型，表面采用特殊技术处理，璀璨华丽尽显贵族色彩。  \n  公司自成立以来，一直以技术为宗旨，以市场为导向，以创新求发展，不断开拓新产品，新市场，在市场竞争日益激烈的今天不断发展壮大。我们秉承“质量求生存”、“创新求发展”、“管理求效益”的经营理念，提倡 “爱家庭、爱客户、爱公司” 的企业文化,精细的品质﹑快捷的效率﹑具竞争性的价格﹑热忱的服务是我们为广大客户承诺的宗旨! ', '深圳市爱的芯科技有限公司', 'https://oss.ywq157.com/diquan/vmhgzxi9jkj.jpg', 'https://oss.ywq157.com/diquan/oj19gy5xbu9.jpg', 'https://oss.ywq157.com/diquan/v4ue7fz6aqs.jpg|https://oss.ywq157.com/diquan/ykzj60g8pkm.jpg|https://oss.ywq157.com/diquan/jv1pw94w5e.jpg|https://oss.ywq157.com/diquan/ioavjzprga9.jpg|https://oss.ywq157.com/diquan/on0jv44m02.jpg|https://oss.ywq157.com/diquan/np5szjjaufh.jpg|https://oss.ywq157.com/diquan/1lx21orbsyx.jpg', 'www.idixin.com.cn', null, '1', '2019-03-20 01:39:42', '2019-03-27 01:29:35');
