INSERT INTO `company_info` VALUES ('76c9ccf59ecb340ad86e5161d40e22e2', 'b20f3a1d75e7f3ab5db21119af72a729', '1', '2', '22.54161', '114.08465', '深圳市福田区都会电子市场利发电子商行', '都会100电子城1B055', '4楼4c118', '1', '陈', '国涛', '', '陈国涛', '', '', '', '13823541760', '0755-82814396', 'https://oss.ywq157.com/diquan/0k4pq7rjres6.jpg|https://oss.ywq157.com/diquan/4zdjfteaqmh.jpg|https://oss.ywq157.com/diquan/kma5igyhjzl.jpg', '轻触开关,按钮开关,按键开关,USB插座,连接器', ' 浙江欧麦特电子有限公司，专业从事各种小型、微型开关的开发、研制和生产。 “十年磨一剑”，经历了大浪淘沙的洗礼，欧麦特电子在强手如林的竞争中  摸索出一条适合自己可持续发展的道路，今天，欧麦特已傲然挺立在市场经济的船头。\n      目前，公司产品达数百个品种,上千种规格。包括各种直插、贴片、防水、防尘、带灯型轻触开关;有锁和无锁、有声和无声复位开关；超薄型拨动开关；按钮和船型电源开关；微动和门锁开关,及AV系列插座和连接器等。\n      多年来，在公司致力于同台湾地区，韩国等的一些知名同行业公司进行技术交流和协作，与多所高等院校和科研院所联手合作,开发出一系列高难度，高质量产品。全面实施ISO9000，ISO14001:2004系列管理体系，为贯彻“做精良产品，创世界品牌”的宗旨奠定了坚实、可靠的基础和保证。 乘借“入世”的东风，我们将不懈努力，精益求精，以优质的产品和优良的服务回报社会和广大新老朋友。\n      我们将继续遵树企业形象，建科学管理、奉精诚服务\"的企业宗旨，积极开发和研制新产品，引进高新技术，努力向高附加值产业和高、精、尖产品方向拓展；以自身的雄厚实力、高雅和完美的品质，具有竞争力的价格，来最大限度地满足一般和特殊客户（包括OEM最为苛刻设计、开发）的不同需求，用以提高市场占有率，促进企业上档次、上水平，增强企业的竞争能力，走向追求卓越、多领域拓展的明天！', '浙江欧麦特电子有限公司', '', '', '', 'http://www.omten.com', null, '1', '2019-01-04 02:17:05', '2019-02-25 08:48:14');
