INSERT INTO `company_info` VALUES ('809f0c1e801671e3cf3bd666374e7ae3', '454a27c3040b21f370a3d0a41224a923', '1', '2', '22.78308', '113.78448', '', '广东省东莞市兴一路66号南方科技专修学院附近', '东莞市长安镇乌沙社区环南路2号万利丰工业园A栋', '2', '何', '香香', 'https://oss.ywq157.com/diquan/sfnit5xltk.jpg', '何香香', 'https://oss.ywq157.com/diquan/s9wemaupkuk.jpg', 'https://oss.ywq157.com/diquan/ajzbq9w6it.jpg', '', '13380197515', '13148834343', 'https://oss.ywq157.com/diquan/vm8n7pkv3lj.jpg|https://oss.ywq157.com/diquan/p81rg6wghqi.jpg|https://oss.ywq157.com/diquan/mu6gjc8v65m.jpg|https://oss.ywq157.com/diquan/pwc8l1kyag9.jpg|https://oss.ywq157.com/diquan/vt2cbbd54t.jpg|https://oss.ywq157.com/diquan/gxa0n0tbre7.jpg|https://oss.ywq157.com/diquan/evj460w9c77.jpg|https://oss.ywq157.com/diquan/4hxyqfc8bd.jpg|https://oss.ywq157.com/diquan/iqpbvh45c1r.jpg|https://oss.ywq157.com/diquan/zmxfd4ack7t.jpg', '弹簧触指 大电流插孔插针 端子连接器 五金 BTB产品', '东莞市簧中簧电子有限公司（SiS）成立于2011年10月，专业从事弹簧触指&大电流接插件的设计、测试、制造的公司，于2018年5月迁移至东莞市长安镇。公司拥有CNC车床车间，弹簧触指车间，装配车间，实验室。 基于连接器各行业对大电流连接器的要求越来越高，簧中簧电子研发了新型的双向螺旋弹簧触指（SiS®）、单圈弹簧触指，构成多个阵列式形变接触点（可达300个点以上）。可以满足超过十万次的插拔使用寿命，弹簧触指电流密度和温升接近于传输电缆，单圈插拔力5-10N左右。 簧中簧电子的PCB板连接器（板到板USC，板到线），圆柱形快速插拔自锁连接器（塑胶和金属外壳），公母同体重载连接器，电动汽车充电器，高压动力电池包串联连接器，应用于最先进的大电流能源采集器、能源储存器及电气设备，\n\n例如：电动汽车、充电基站、风能发电机、电源供应器、高铁、重卡等等。 公司拥有国家多项发明&实用新型专利，产品通过国际标准测试。', '东莞市簧中簧电子有限公司', '', 'https://oss.ywq157.com/diquan/rr5wi2n8r0q.jpg', 'https://oss.ywq157.com/diquan/spxigjq18yn.jpg|https://oss.ywq157.com/diquan/60l99vvtnu6.jpg|https://oss.ywq157.com/diquan/ojh47pdmzcq.jpg|https://oss.ywq157.com/diquan/d1or32tffsa.jpg|https://oss.ywq157.com/diquan/9hty0cyty7a.jpg', 'http://www.szsise.com', null, '1', '2019-03-04 07:50:24', '2019-03-15 13:03:43');
