INSERT INTO `company_info` VALUES ('871b969d3d2950f2519a6e7efba4de49', 'ae24cbdca2fcebc6a38753b519c30618', '1', '2', '22.77175', '113.91943', '深圳市威能电子有限公司', '公明镇新湖街道楼村灿博科技园A区C栋6层', '灿博科技园A区C栋6楼', '2', '李', '凤', 'https://oss.ywq157.com/diquan/1zibus0ou6u.jpg', '李凤', '', '', '', '17765299619', '0755 27809917', 'https://oss.ywq157.com/diquan/i735rj2w49f.jpg|https://oss.ywq157.com/diquan/wq59u5n4uw.jpg|https://oss.ywq157.com/diquan/yk6cs6em8xr.jpg|https://oss.ywq157.com/diquan/fjr34kk68uk.jpg|https://oss.ywq157.com/diquan/t131xva35t.jpg|https://oss.ywq157.com/diquan/2m2jca8l6wh.jpg|https://oss.ywq157.com/diquan/gz2mupfxrz.jpg|https://oss.ywq157.com/diquan/ae2zmrpxdv.jpg|https://oss.ywq157.com/diquan/1kt8x0cmacw.jpg|https://oss.ywq157.com/diquan/wt561660zhc.jpg', '纽扣电池,遥控专用电池,电子表专用电池,防盗器专用电池,LED闪灯专用电池,电子称专用电池等 AG系列,CR系列,LIR系列 ,组合柱式电池,干电池', ' 威能电池厂成立于1999年，是具有先进技术水平的绿色高能环保电池厂家之一，以技术领先的碱锰电池为主导产品，致力于成为环保能源领域的领先企业。   \n我们始终坚持科技创新，以高素质专家团队主持研发制造，拥有相关电池配方、结构、制造的系列专利和专有技术，构筑起了完整的自主知识产权体系；建立了门类齐全、学历层次合理的研发队伍，聘用多名电池专家对电池产品及质量进行不断的研制与创新。威能研制的碱性环保电池已达到国内先进水平。    \n所属企业产品有AG碱性、SR氧化银、CR锂锰、AA(5号)/AAA(7号)柱式碱性、镍氢、镍镉、LIR锂离子充电电池等,我们引进先进的制造、检测设备，现已拥有大规模、专业化、自动化的生产制造能力。公司建立了完整的质量管理体系，通过了ISO9001质量体系认证，产品通过了UN38.3、CE和SGS认证，符合RoHs指令要求。所有产品均被国家有关部门认定为“高新技术产品”和“环保创新产品”。 \n企业占地近1.5万平方米、员工八百多人。其中高中级技术人才达四十余人，并设有专业电池研究开发室。这些年来，公司一贯坚持建立全质量体系，力争满足客户的质量方针“信誉至上、质量第一、开拓进取、精益求精”的企业形象，引进优质的生产技术以及先进制造工艺，对产品生产实施全面监控，故产品放电容量高、电压平稳、低内阻、防漏液性能好、密封性能高、贮存寿命长、等一系列优点。      \n威能电池厂所生产的电池好用便宜，型号齐全，我们秉承以细心的服务换取客户最大的满意，坚持以市场为导向，以满足顾客需求为己任，凭借优良、创新的产品和高标准的质量，获得了广大客户的信赖，产品主要供应欧美，中东、非洲国家和地区及中国工业配套市场等领域。立足中国,服务世界是威能公司全体员工追求的目标。深圳市威能电子有限公司的诚信、实力和产品质量获得业界的认可。我司将以多元化的产品售后服务，不断对产品质量要求改进，诚心诚意为顾客服务，保证质量稳定持久，做到良好的品质，为客户提供更多更好的优质电池，更低更满意的价格！\n    欢迎各界朋友莅临深圳市威能电子有限公司参观、指导和业务洽谈。\n                            深圳市威能电子有限公司\n                   联系人：李凤\n                   手  机：17765299619\n                   QQ号码：2850727557\n                   电  话：0755-27809917\n                   传  真：0755-27809919\n         ', '深圳市威能电子有限公司', '', 'https://oss.ywq157.com/diquan/xqfzxe1ww49.jpg', 'https://oss.ywq157.com/diquan/feywpkfbk9d.jpg', 'www.weineng-gd.com', null, '1', '2019-01-07 03:07:01', '2019-01-15 06:42:03');
