INSERT INTO `company_info` VALUES ('96305a9b2386c1ff49d53ff16e48836d', '24e89c688128ea6393440efee9e03003', '1', '2', '31.23894', '121.32481', '万达广场江桥店10号写字楼', '江桥镇鹤旋路26弄2号', '上海嘉定区江桥万达', '1', '沈', '建军', 'https://oss.ywq157.com/diquan/yohyrhmyys.jpg', '沈建军', '', '', '', '18616543939', '021-5955 7305', '', '继电器驱动芯片|液晶驱动芯片', '上海熠孜电子科技有限公司是一家从事集成电路开发和销售的企业。公司坐落于上海奉贤区，创立于10年代，注册资本600万。公司专注于智能电网低压用电信息采集、配电网信息传输与控制设备及物联网领域的芯片及其解决方案的开发、生产、销售。我司在电子电度表电路领域也进行了不断的开发，7755、7752电路已达到并在某些方面超过了同类其他品牌电路。我司在LED、LCD驱动电路上也在不断开发，凭借我们产品的质量，价格优势，已完全替代同类进口产品。\n 本公司有多名科研人员：博士2名、研发工程硕士8名、硬件工程师3名及软件工程师3名，都是在行业知名企业贝岭、锯泉、锐能微等品牌芯片公司任职，主要从事芯片的研发及生产。', '上海熠孜电子科技有限公司', '', '', '', 'www.shanghaiyizi.cn', null, '1', '2019-01-10 03:27:40', '2019-01-10 03:36:28');
