INSERT INTO `company_info` VALUES ('9c75ced3c1499d985a90f382205ec317', '193bbb1f227b4708c087ebff91711c58', '1', '2', '22.63420', '114.05190', '深圳新太开发科技有限公司(西门)', '中裕冠大道7号附近', '深圳市龙华区龙华街道中裕冠大道7号厂区3层', '1', '朱', '贺', 'https://oss.ywq157.com/diquan/wet99kgs8f.jpg', '朱贺', '', '', '', '18027652286', '18027652286', '', '画面分割器,车载产品,方案和主板厂家', '新太开发是一家集设计、研发、生产、销售和服务于一体的专业视频处理解决方案供应商。新太开发以客户为中心，以创新为驱动，深刻理解客户的需求与挑战，结合自身多年积累的行业经验，利用大数据与人工智能技术开发出高清视频画面分割器系列、高清低功耗人体感应无线WIFI（带录像）智能摄像机系列、高清低功耗人体感应无线WIFI（带录像）智能门铃系列、高清低功耗无线WIFI硬盘录像机NVR系列、车载高清低功耗（带GPS全球定位功能）3G/4G远程监控硬盘录像机系列、360度全景无缝拼接行车记录仪系列、车载盲区辅助驾驶系统等产品。公司拥有二十余项计算机软件著作权证书和实用新型专利证书。源于对技术的不断创新，新太开发获得国家高新技术企业和深圳市高新技术企业双高证书。\n新太开发通过完善的质量管理体系，向客户提供满意的服务与产品。\n新太开发的产品广泛运用于铁路高铁地铁项目，公路管理系统，车厂前装辅助驾驶系统，驾校驾考系统，大型车队（交通运输、城市公交）管理系统，智能家居等各个领域。', '深圳新太开发科技有限公司', '', '', '', 'www.szsuntex.com', null, '1', '2019-01-19 06:07:17', '2019-03-18 06:12:49');
