INSERT INTO `company_info` VALUES ('9e2879e3fd0b05c2c24c46e8e88b7598', 'ac823fe79fdd9792f05511aad1be374f', '1', '2', '22.94442', '114.01262', null, '广东省东莞市环常南路桥沥马屋新村二街53号', '东莞市常平镇桥沥马屋新村二街53号', '2', '冉', '吉琴', 'https://oss.ywq157.com/diquan/sbz3nsnjthj.jpg', '冉吉琴', 'https://oss.ywq157.com/diquan/07xkzzebtf3s.jpg', 'https://oss.ywq157.com/diquan/cyfzmr2ye8m.jpg', null, '18566557844', '0769-83338225', 'https://oss.ywq157.com/diquan/giqmv1i8zq9.jpg|https://oss.ywq157.com/diquan/y7tvkszrbpr.jpg|https://oss.ywq157.com/diquan/nvd5q1qhjml.jpg|https://oss.ywq157.com/diquan/8qf445ij46g.jpg|https://oss.ywq157.com/diquan/z68ceo1e5e.jpg|https://oss.ywq157.com/diquan/v1sm1a5poz.jpg|https://oss.ywq157.com/diquan/pphb9zq0evc.jpg|https://oss.ywq157.com/diquan/7vuvcef7iel.jpg|https://oss.ywq157.com/diquan/tu01ijwq1h.jpg|https://oss.ywq157.com/diquan/sbcxfouve4o.jpg', '恒温恒湿试验箱,高低温试验箱,冷热冲击箱,高温烤箱,振动台,烟雾箱等', '公司介绍：东莞市科文试验设备有限公司，是集可靠性测试设备、品质检测及提供实验仪器技术服务为一体化的生产厂家。\n    主营产品：【环境类试验设备】：恒温恒湿试验箱，高温低温试验箱，冷热冲击试验箱，紫外光老化试验箱，氙灯老化试验箱，步入式恒温恒湿试验室，高温老化房，快速温变试验箱，沙尘试验箱，淋雨试验箱，盐雾腐蚀试验箱，各种高温烤箱，电热鼓风干燥箱，真空干燥箱等环境试验箱。\n【材料力学类检测设备】：电磁振动台，六度/四度一体机振动台，酒精耐磨擦试验机，模拟运输振动台，跌落试验机，​拉力试验机，万能材料试验机，按键寿命试验机，线材弯折试验机，箱包测试机，纸箱抗压试验机，手机电脑试验机，电子线材试验机等多种产品。\n以简约高质精准推出恒温恒湿试验箱，优良品质，技术卓越！ \n质量是企业数值的最高体现\n顾客满意是企业永远追求的终极目标\n严谨的科学管路和永无止境的技术创新是企业发展的坚定基础\n我们愿以始终如一的热情，为您提供高质量的产品、优质的服务\n\n并竭诚为广大用户研制特殊方案的试验设备，能充分满足不同行业客户的各种需求。科文生产的试验设备主要应用于：IT、通讯、电子、电器、汽车、LED、LCD、化工、塑胶、橡胶、塑料、金属、建筑、电线电缆、皮革、纺织、医药、机械、箱包、印刷及其高等院校等。\n\n在激烈的市场竞争中，东莞市科文试验设备有限公司以自身的实力及 优秀的口碑先后中标华中科技大学、武汉理工大学、中国矿业大学、重庆交通大学、北方中国舞台上赢得了广泛的知名度和影响力，引领“中国制造”走向“中国创造”。\n实干赢取未来，创新成就梦想。展望未来，科文将坚持专业化的发展战略，求真务实，开拓创新。“科技与文化的和谐体验”科文始终坚持“用科技和文化打造和谐企业”这一企业文化，以“缔造高品质的试验设备企业”为目标，为“中国梦”贡献更多的力量。工业大学、中国科学院、中国航天集团等多个配套实验室仪器设备工程，在中国舞台上赢得了广泛的知名度和影响力，引领“中国制造”走向“中国创造”。\n科文拥有先进的生产、检测设备和专业的技术团队；可根据客户的要求进行设计、开发与生产，并对产品质量持续试验提升。近年来，科文已为航空、航天、军事、IT、通讯、电器、汽车、化工、塑胶、橡胶、塑料、金属、建筑、电线电缆、皮革、纺织、医药、机械及其高等院校等领域提供了大量的试验设备，深受广大用户青睐。“提供优质产品，服务一流企业，创立科文品牌，成为业界领航”是公司多年来奉行的经营理念。', '东莞市科文试验设备有限公司', 'https://oss.ywq157.com/diquan/mn2o6vuthgq.jpg', 'https://oss.ywq157.com/diquan/uerdsa11bbh.jpg', 'https://oss.ywq157.com/diquan/ceabh46465h.jpg|https://oss.ywq157.com/diquan/amn2g318sk.jpg|https://oss.ywq157.com/diquan/wftn8ez6n3j.jpg|https://oss.ywq157.com/diquan/eauqflhgu1f.jpg|https://oss.ywq157.com/diquan/2dcauzpsg37.jpg|https://oss.ywq157.com/diquan/n9w0db0xfpi.jpg|https://oss.ywq157.com/diquan/a1246pev6eg.jpg|https://oss.ywq157.com/diquan/gvdodawtp9o.jpg|https://oss.ywq157.com/diquan/tu5kgbyem19.jpg|https://oss.ywq157.com/diquan/tj7jz0326q.jpg', 'http://www.kowintest.cn ', '2019-04-20 12:53:34', '1', '2019-04-20 09:27:28', '2019-04-20 12:35:52');
