INSERT INTO `company_info` VALUES ('a03c1ee9f32c04bf2af0b7a20ff3ea49', 'b0eb219932cff9b941eb7771c7d203da', '1', '2', '22.72013', '114.31838', '宝莱特工业园', '同乐社区新布路24号', '深圳市龙岗区同乐社区新布路', '1', '李', '志', '', '李志', '', 'https://oss.ywq157.com/diquan/6hav6k0id3k.jpg', '', '18138834190', '18138834190', 'https://oss.ywq157.com/diquan/cigxlj4pff.jpg|https://oss.ywq157.com/diquan/5fek9s2e15.jpg|https://oss.ywq157.com/diquan/8e8kvkoj34i.jpg|https://oss.ywq157.com/diquan/jk9955p6fl.jpg|https://oss.ywq157.com/diquan/kj0dvq8syya.jpg|https://oss.ywq157.com/diquan/d3qeu03eqok.jpg|https://oss.ywq157.com/diquan/sgv1chfgd8d.jpg', '美规电源|欧规电源|智能电源|内置裸条电源|恒压电源等', ' 深圳市安规科技有限公司是一家专业从事LED电源、定制电源、磁性元件研发，生产，销售的高新科技企业。公司坐落于深圳市龙岗区同乐，经过七年来的发展，已形成了日光灯电源，面板灯电源，筒灯电源三大系列产品。电源产品年生产能力300万台，其中80%的产品出口到世界各地几十个国家和地区，包括美国，德国，英国，俄罗斯，西班牙，日本等；产品通过UL、GS、VDE、TUV、3C、FCC、CE等认证。\n        公司秉承“品质，效率，创新，服务”的经营理念，以提供高性能，可靠的产品为根本，以不断创新为依托，快速高效地为客户服务。以“专注只为您”为企业宗旨，用专业的技术，专心的态度，专注的精神，将提供世界一流的LED绿色产品作为自身最高追求。', '深圳市安规科技', '', 'https://oss.ywq157.com/diquan/78xvqvjrlnm.jpg', '', 'www.agt.net.cn', null, '1', '2019-01-03 02:53:06', '2019-01-09 11:04:44');
