INSERT INTO `company_info` VALUES ('ba139a3200cdb3ca50083032fb52495d', 'dd8a8f061abe33a3213646f65b4e7e67', '1', '2', '22.69790', '113.99564', '石凹同富邨工业区停车场', '大浪北路东50米', '龙华新区大浪北路同富邨工业园10栋', '1', '周', '波', 'https://oss.ywq157.com/diquan/7tw346cv8sq.jpg', '周波', '', '', '', '18813938968', '0755-23771185', 'https://oss.ywq157.com/diquan/s3omd8nq43h.jpg|https://oss.ywq157.com/diquan/iud28vyrsdr.jpg|https://oss.ywq157.com/diquan/pydbljfnz6.jpg|https://oss.ywq157.com/diquan/vyng3p3xns.jpg|https://oss.ywq157.com/diquan/e12w8qovzs8.jpg|https://oss.ywq157.com/diquan/273p2arpsev.jpg|https://oss.ywq157.com/diquan/wpkt1bn5o89.jpg', 'LCD液晶显示屏', '                                                  公司简介\n         深圳市众德鑫光电技术有限公司集研发、生产、经营 LCD液晶显示屏/LCD背光源及其它光电器件为一体的专业厂家。生产LCD段码屏、LCD液晶显示屏、LCD黑白显示屏、黑白段码屏，提供黑白段码屏定制、LCD数码屏定制生产，产品广泛应用于各类LCM模组、仪器仪表、音响、医疗设备等领域。\n        公司采用人性化管理激励机制，重视产品的实用和创新，注重绿色、节能、环保的社会责任，实现个人、企业、社会的和谐发展。 公司在绿色环保方面，公司经过严格的程序选择供应商，所有物料都符合ＲＯＨＳ及REACH要求。  \n         公司采用全封闭的洁净厂房，现有多条全自动，半自动生产线，同时配备背光源专业生产和高端可靠性检测设备。 产品广泛应用于各类LCM模组、仪器仪表、音响、医疗设备、家电控制器、通讯模组、遥控器、数显钟表等领域。公司现拥有一批优质中、外客户。 另外，公司与国内、外先进的LCD厂家合作，开发、生产、销售高品质的液晶显示片和液晶模组。现有TN、HTN、STN、TFT等各种类型标准。我们郑重承诺以质优价廉，一流服务办厂理念，诚与新老客户及合作伙伴携手并进，共创多赢。 ', '深圳市众德鑫光电技术有限公司', '', '', 'https://oss.ywq157.com/diquan/47tq0b8jf2g.jpg|https://oss.ywq157.com/diquan/e1yw1zx9a0j.jpg|https://oss.ywq157.com/diquan/998g594dg0w.jpg|https://oss.ywq157.com/diquan/3jsrghroazl.jpg|https://oss.ywq157.com/diquan/4gnkc6umt7f.jpg|https://oss.ywq157.com/diquan/qmgwfc8sh6.jpg|https://oss.ywq157.com/diquan/hxxfantx2i8.jpg|https://oss.ywq157.com/diquan/346j49sfwy7.jpg|https://oss.ywq157.com/diquan/ucrk9q9ope.jpg', 'http://www.zoomedsun.com', null, '1', '2019-01-05 01:19:43', '2019-02-20 03:49:21');
