INSERT INTO `company_info` VALUES ('beda151212fd63aa4d41b67428ef3bda', '5ebc9ab1fbe58816ceeb3f96d9f1ea85', '1', '2', '22.69397', '113.99773', '', '广东省深圳市龙华区凯滨新村对面正北方向36米', '深圳龙华大浪新围第三工业区', '1', '雷', '生', 'https://oss.ywq157.com/diquan/z6v37jseqte.jpg', '雷生', '', '', '', '18617019345', '18617019345', 'https://oss.ywq157.com/diquan/5wan2iu7tks.jpg|https://oss.ywq157.com/diquan/dm82n2knx6t.jpg|https://oss.ywq157.com/diquan/tmdqr2hgtyq.jpg|https://oss.ywq157.com/diquan/1nrttcmsir4.jpg|https://oss.ywq157.com/diquan/lp1nybat71e.jpg|https://oss.ywq157.com/diquan/ziyc650fhjr.jpg|https://oss.ywq157.com/diquan/35476tavoky.jpg', '四线电阻触摸屏, 五线电阻触摸屏, 车载电容屏, 工业电容屏, 电脑电容屏, 投射电容触摸屏', '深圳市瑞翔数码科技有限公司成立于2007年，是集研发、设计、生产、销售于一体的触摸屏专业制造商,主要生产电阻式/电容式触摸屏,其产品广泛应用于GPS车载导航、智能家具、安防、医疗电器、仪器、仪表等领域。厂房面积4000平方米，年生产能力600万片，拥有先进的生产设备，及百级的净化车间，确保符合产品对生产设备及环境的要求。公司于2014年通过ISO质量管理体系认证，并顺利通过MOTOROLA、纬创资通等知名企业的资格考核验证，公司拥有众多从事多年触摸屏行业之工程师、品管、生产、管理人员，可根据市场普遍之标准或者按客户要求研发制作特定产品，为客户提供一系列的高品质产品。 公司秉承“诚信   创新   高效   优质”的经营理念，锐意进取，永续经营，以开拓触摸技术为己任，以追求卓越品质、提供一流服务为目标，以客户至上、信誉第一为原则，努力探索行业之先进技术，不断完善产品，以期为行业提供最适宜的产品。', '深圳瑞翔数码科技有限公司    触摸屏专业制造商', '', '', 'https://oss.ywq157.com/diquan/zkpov74orh8.jpg|https://oss.ywq157.com/diquan/bf7cfrjlh0a.jpg', '', null, '1', '2019-03-27 03:09:28', '2019-03-27 07:33:45');
