INSERT INTO `company_info` VALUES ('c6a3d3137b8e1d5d7c24bc3422555d7e', '5463bd5c4f4aafd62a26defa0a600000', '1', '2', '22.61044', '113.84174', '', '广东省深圳市宝安区宝安大道5001号', '深圳市宝安区西乡街道到三围宝安大道5001号沙边工业区A栋三楼', '2', '李', '艳', 'https://oss.ywq157.com/diquan/3mnzu6vsvnm.jpg', '李艳', 'https://oss.ywq157.com/diquan/rbm6oowyv8i.jpg', 'https://oss.ywq157.com/diquan/8h2ugaw4wha.jpg', '', '18397420568', '18397420568', 'https://oss.ywq157.com/diquan/ho8of4ic2xb.jpg|https://oss.ywq157.com/diquan/pckwzcbs69.jpg|https://oss.ywq157.com/diquan/97riyu475mm.jpg|https://oss.ywq157.com/diquan/ctvg67m5n9f.jpg|https://oss.ywq157.com/diquan/2abvqvsm0n5.jpg|https://oss.ywq157.com/diquan/uokzf3lhpf.jpg|https://oss.ywq157.com/diquan/imelsx1akb.jpg|https://oss.ywq157.com/diquan/4ifbj76qa4w.jpg|https://oss.ywq157.com/diquan/438awrzl3ft.jpg|https://oss.ywq157.com/diquan/3eofy6zbn3e.jpg', '不锈钢焊接锡膏,倒装芯片固晶锡膏,激光焊接锡膏,固晶锡膏,锡膏', '深圳市华茂翔电子有限公司是一家专业生产焊锡膏、胶粘剂以及各类塑胶包装容器的公司。公司集研发、销售、技术咨询并与大型工厂合作代工为一体的电子塑胶高新技术企业。\n公司拥有先进的自主研发团队并与国内北京大学、湖北大学等高校技术合作；拥有阵容强大具有丰富经验的技术研究人员和精湛、高效的业务团队。\n公司现已研发并生产焊锡产品类、胶粘剂类、塑胶包装容器等系列环保产品。产品广泛应用于计算机、信息通迅、家用电器、电子玩具、数码摄影、半导体，化工包装等电子行业。\n    焊锡产品适合激光焊接、脉冲焊接和烙铁快速焊接、Hot-bar焊接。焊接后无锡珠和很少残留。用于产品VCM、CCM、模组、耳机、连接线、马达、喇叭等。\n公司以诚信经营，求真务实的精神，以优质的产品，良好的信誉，竭诚为您提供完善的售前、售中、售后服务，您的需求就是我们的追求，质量的提高是我们的责任，华茂翔愿与您携手共同开创美好的未来。', '深圳华茂翔电子有限公司', 'https://oss.ywq157.com/diquan/m2snwylf0s.jpg', 'https://oss.ywq157.com/diquan/niic3p4pvy.jpg', 'https://oss.ywq157.com/diquan/8r66g4yor24.jpg|https://oss.ywq157.com/diquan/yjitu1n2r3.jpg|https://oss.ywq157.com/diquan/tnz6bkm1uf.jpg|https://oss.ywq157.com/diquan/psc4ceu5fm.jpg|https://oss.ywq157.com/diquan/0i7ac0ihjxer.jpg|https://oss.ywq157.com/diquan/5hb5fujjtz.jpg', 'www.sz-hmx.com', null, '1', '2019-02-26 06:27:43', '2019-04-11 11:09:42');
