INSERT INTO `company_info` VALUES ('c7210a2aec409fe5c33dc040055ac157', '2c044247a40b385bcec826c9a608981c', '1', '2', '22.75629', '113.83068', '深圳市麦轩食品有限公司(西门)', '松岗镇街道潭头西部工业区', '深圳市宝安区松岗街道潭头西部工业区52-53栋', '2', '张', '海玲', 'https://oss.ywq157.com/diquan/wt85a3tvqsr.jpg', '张海玲', 'https://oss.ywq157.com/diquan/adb2jc5x6t.jpg', 'https://oss.ywq157.com/diquan/c99pgnsarkd.jpg', '', '13825294113', '29718228', 'https://oss.ywq157.com/diquan/bdsunpcvqac.jpg|https://oss.ywq157.com/diquan/v8pren7c5qb.jpg|https://oss.ywq157.com/diquan/gywy0gtk1k8.jpg|https://oss.ywq157.com/diquan/s58zgfls2ta.jpg|https://oss.ywq157.com/diquan/8e8dv4bixtu.jpg|https://oss.ywq157.com/diquan/87x5sj7r8y8.jpg|https://oss.ywq157.com/diquan/y9da8zqbdw.jpg|https://oss.ywq157.com/diquan/9ntvbfap54.jpg|https://oss.ywq157.com/diquan/00bmt9ri9ah2n.jpg|https://oss.ywq157.com/diquan/5nav342jri.jpg', '粽子|月饼|年货', '深圳市麦轩食品有限公司、地处于经济繁荣、交通便利的深圳市宝安区松岗潭头西部工业区，毗邻港澳，创建于1993年，从一家饼店开始经营，发展至今，拥有16000平方米现代化厂房、3000平方米员工宿舍楼；拥有一支开拓创新、勤奋敬业的优秀团队，其中各类中高级管理、市场营销、专业技术人员100余人（含外聘专家顾问）；公司在秉承香港麦轩饼家“一丝不苟、日臻完美”传统工艺理念的基础上，与时俱进，不断创新，严格按ISO9001和HACCP质量管理体系，控制供应链和生产的每一个环节，保证产品质量的稳定和持续改进；是一家集设计、研发、生产、销售、服务于一体的食品企业；主要产品有：中式传统饼点（主导产品有老婆饼、合桃酥、鸡仔饼）、月饼系列（广式月饼、港式月饼、台式酥饼、异国风情月饼）和年货系列（油炸类糕点、烘烤类糕点、曲奇饼干）等至臻至美饼点系列。', '深圳市麦轩食品有限公司', 'https://oss.ywq157.com/diquan/c4pmkupjua.jpg', 'https://oss.ywq157.com/diquan/7brbcaa51jr.jpg', 'https://oss.ywq157.com/diquan/ftk32gopwha.jpg|https://oss.ywq157.com/diquan/od7jifxs1c.jpg|https://oss.ywq157.com/diquan/gfcru4vm6ac.jpg|https://oss.ywq157.com/diquan/wp7v77ci4bg.jpg|https://oss.ywq157.com/diquan/f7hw27lzkb.jpg|https://oss.ywq157.com/diquan/eaj431ro8ul.jpg|https://oss.ywq157.com/diquan/rp807rbf27b.jpg|https://oss.ywq157.com/diquan/4qaj9rs93ib.jpg|https://oss.ywq157.com/diquan/q9o26xgdw1.jpg|https://oss.ywq157.com/diquan/pr5283fyofm.jpg', 'www.makhin.cn', null, '1', '2019-02-26 12:37:41', '2019-02-26 13:45:29');
