INSERT INTO `company_info` VALUES ('d4f243539edcac07780fd7dafa818175', 'fa6a963a6f064823a09ff561399b1b11', '1', '2', '30.60078', '114.30152', '武汉市总共工会江汉区总工会', '麟趾路50号附近', '武汉市总共工会江汉区总工会', '1', '王', '强军', 'https://oss.ywq157.com/diquan/vbgmimpzf5o.jpg', '王强军', 'https://oss.ywq157.com/diquan/aap793d1lcj.jpg', 'https://oss.ywq157.com/diquan/ehoose6jv5u.jpg', '', '13971328635', '13971328635', '', '物流系统TMS/WMS/供应链管理/企业ERP/进销存/HR/房地产评估规划/电子政务/会展服务', '\n上海诺构软件技术有限公司是一家致力于业务基础架构平台的技术研发、行业应用、销售、推广与服务并获得双软认定的综合型的软件技术公司，在南京、武汉等地组建分公司,办事处机构。\n经过十多年的持续研发和多年的应用实施，诺构软件开发了具有完全自主知识产权的业务基础平台，该平台的数据模型引擎、业务规则引擎、服务体系架构在国内管理软件开发行业中有着震撼力的影响，并与多家IT机构和软件开发企业形成战略合作关系。目前，XBM 业务基础架构平台已在物流、电子政务、房地产评估规划、供应链管理、中小型企业 ERP等行业得到成功应用，深得用户的认同和高度评价。\n公司在致力于发展业务平台的基础上，秉承只有帮助客户创造价值的技术才具备价值的技术理念，着重于技术产生价值、技术服务于客户的行业应用，将为更多的中国企事业单位提供完善、适用、前瞻性的综合管理解决方案，为更多的中国企事业单位信息化建设提供快速发展通道。\n我们深知：专业，乃服务于客户之基础；诚信，乃经营企业之根本。因此，我们将在中国IT行业快速发展的今天，以更加精益求精的专业精神和更加至诚致信的服务，领航信息技术，创新行业革命，并以此作为我们企业孜孜不倦追求的目标。', '上海诺构软件技术有限公司', 'https://oss.ywq157.com/diquan/ek2t2zxmrud.jpg', 'https://oss.ywq157.com/diquan/zx3nts4hpr9.jpg', '', 'http://www.norgo.com.cn', null, '1', '2019-01-11 08:10:38', '2019-01-16 06:25:31');
