INSERT INTO `company_info` VALUES ('d5e75a8e00e3c9bca701f4fa487a4fc5', '8e4f3f95ae64cb6e26df38afc6e704d4', '1', '2', '22.64264', '113.86438', '保禄安防', '西乡洲石路564号开大工业园', '深圳市宝安区西乡街道九围洲石路564号开大工业园A栋E区3号西', '1', '梁', '炎禄', 'https://oss.ywq157.com/diquan/f9gft46xw5t.jpg', '梁炎禄', '', '', '', '18588479244', '0755-33558598', '', '移动电源套料 充电宝', '科瑞泓德（深圳）科技有限公司成立于2013年，是一家专业的外观设计，结构设计，模具设计，模具制造、注塑成型加工的一站式企业. \n公司位于深圳市宝安区西乡街道九围洲石路564号开大工业园A栋E区3号西，办公室占地面积680㎡，工厂加办公室占地面积1200㎡，设计团队8人，工模师傅3名，模具设计师，结构设计师3名，模具工程师多名，职员工60人。 \n\n公司拥有先进的CNC加工中心，火花机、铣床、车床、磨床、线切割等各类加工设备，完全实现CAD/CAM加工一体化。更配80吨至350吨位注塑机，能够满足广大客户的普遍需求。 \n\n公司拥有优秀的设计人才团队，每个产品的诞生都赋予了我们团队的力量和创新的..', '科瑞泓德（深圳）科技有限公司', '', '', '', 'https://corisemold.1688.com', null, '1', '2019-02-25 07:28:46', '2019-02-28 07:32:56');
