INSERT INTO `company_info` VALUES ('d9fa6e843a27c571cd003e6a8ce347d7', '6030fd4ba30b0d51f1dc67359d890822', '0', '0', '22.74348', '114.36490', null, '广东省深圳市坪山区坑梓汽车站(沈海高速公路南)', '深圳市坪山区龙田街道深龙西巷4号', '1', '邱', '贵敏', 'https://oss.ywq157.com/diquan/qxvz49r5fai.jpg', '邱贵敏', 'https://oss.ywq157.com/diquan/icdth2uic7.jpg', 'https://oss.ywq157.com/diquan/un6zvrr1srn.jpg', null, '13530781286', '0755-89323408', 'https://oss.ywq157.com/diquan/1suumyv7e82.jpg', '导热硅胶、导垫硅脂、粘接密封胶、灌封胶、UV胶、螺丝胶、环氧树脂胶、三防胶、瞬间胶、修补剂', '   深圳市源新盛科技有限公司代理销售国内外知名品牌胶粘剂、润滑油脂等产品，产品品牌有:陶熙Dowsil(原道康宁Dow Corning)、汉高Henkel、乐泰Loctite、迈图Momentive、信越Shinetsu、赫能Hernon、爱牢达Araldite、3M、Ergo、回天Huitian等，公司一直致于为移动电子设备、智能穿戴、LED封装、半导体、汽车电子、轨道交通、新能源等领域，主要产品分布为工业及电子粘合剂、润滑油脂、UV固化设备及产品，为行业客户提供全面的先进材料及成熟的解决方案。可为金属、塑胶、橡胶、皮革、玻璃、陶瓷、石材、木器、纺织品等材质提供全系列的接着产品及粘接方案。可为电子、光电、电机、电器、通讯等行业的电子元器件、零部件、模块组件、线路板之粘接、密封、灌封、包封、组立、披覆、保护等工序提供十分理想先进的工艺手段。\n    公司一惯坚持：“敬业、创新、务实、高效”的发展理念，不仅为客户提供高品质的产品，同时提供专业的胶粘剂解决方案及完善的供销服务，满足现各层次客户需求! 我们真诚欢迎海内外客户及供应商前来咨询洽谈，共谋发展和建立长期可靠的合作关系！', '深圳市源新盛科技有限公司', 'https://oss.ywq157.com/diquan/z1sox3m5izh.jpg', 'https://oss.ywq157.com/diquan/yu1e549dqle.jpg', 'https://oss.ywq157.com/diquan/3yxu4036i84.jpg|https://oss.ywq157.com/diquan/8pksyt0kd0w.jpg|https://oss.ywq157.com/diquan/93miatoveo.jpg|https://oss.ywq157.com/diquan/lktecxii4zj.jpg|https://oss.ywq157.com/diquan/i6qucuaihe.jpg|https://oss.ywq157.com/diquan/mphrnh7o4om.jpg|https://oss.ywq157.com/diquan/ljzhmbc5u6p.jpg|https://oss.ywq157.com/diquan/gfzyte5v2wm.jpg|https://oss.ywq157.com/diquan/0xl9so0wfa9n.jpg|https://oss.ywq157.com/diquan/hm4of1l4u8k.jpg', 'www.yxstech.com.cn', null, '1', '2019-04-15 20:41:23', '2019-04-17 09:06:01');
