INSERT INTO `company_info` VALUES ('e8cd11f7b2fdf5079e9ef4f9bf96d2b6', '804af14a88ee2294f185bbb8356f65b8', '0', '0', '23.08591', '113.77753', null, '广东省东莞市兴横路5号', '横滘村兴横路5号', '1', '郭', '斌', 'https://oss.ywq157.com/diquan/07ibzfuorbmu.jpg', '郭斌', 'https://oss.ywq157.com/diquan/fwyeizg3va.jpg', null, null, '13929228643', '0769-88480122', 'https://oss.ywq157.com/diquan/qbts7oao1z.jpg|https://oss.ywq157.com/diquan/p3dqsdpd1k.jpg|https://oss.ywq157.com/diquan/tq18to1yyhe.jpg|https://oss.ywq157.com/diquan/xb1z8tulr4e.jpg|https://oss.ywq157.com/diquan/jbwfi4czawa.jpg|https://oss.ywq157.com/diquan/rpnl4ox9pm.jpg|https://oss.ywq157.com/diquan/rklsws47wnn.jpg|https://oss.ywq157.com/diquan/wjc8lhqvvfs.jpg|https://oss.ywq157.com/diquan/dmwgcv2v7om.jpg', '我司专业生产销售,我的业务范围：各类塑胶产品如下,塑料托盘(卡板)、吹塑托盘、周转箱、汽配箱、周转箩、吸塑盒、制造商、塑料包装材料、化工桶、辅助包装材料、、托盘........希望有机会合作,塑胶材料行业专业供应商专业人,只做专业事！有意者可电联：13929228643', '东莞市杰华塑胶制品有限公司成立于2001年，是专业生产销售、研发塑料制品、防静电制品的企业。公司拥有数十名资深模具工程师，结构设计师和十几名机械工程师，品质工程师组成的专业技术队伍，并拥有一支高素质的专业管理和营销队伍，营业网点遍及珠三角，并在上海、浙江等地设有销售公司，拥有一支宠大运输队伍，力争为客户提供最好的服务。\n公司配备了先进的计算机控制，规格齐全的注塑机，中空板挤塑设备，其中领先同行的超大型注塑机数台，并配备了先进的检测设备、仪器产品在创业初以日用塑料为主，逐渐扩展到工业用塑胶制品，如卡板系列、箱类系列、周转箩系列、汽配行业专用系列、吸塑盒系列、中空箱系列等。\n我们秉承\\\'创卓越品质、求完美服务\\\'的质量方针，致力实施\\\'双赢\\\'战略，赢得了广大客户、供货商的一致好评，取得了良好的口碑。 随着全球化的进展，产品生命周期变短，市场变化加速，我们加强了与顾问、技术、科技、媒体、运输、行业的合作，以追求不断地外部变化。我们除了提供多样创新产品外，将以兢兢业业始终如一的精神，为客户提供优质的产品，准时的货期，良好的售后服务 。\n最好的产品、最好的服务、最好的信誉、东莞市杰华塑胶制品有限公司已在运输、生产、工业、农业等诸多领域取得了客户的信任。例如三星、创维、沃尔玛等都与我们公司有密切的合作关系。热烈欢迎国内外新老客户莅临指导，携手合作，共创辉煌。\n\n', '东莞市杰华塑胶制品有限公司', 'https://oss.ywq157.com/diquan/an6byd65xn.jpg', 'https://oss.ywq157.com/diquan/pxgou9imkg.jpg', 'https://oss.ywq157.com/diquan/78fr309q2fu.jpg|https://oss.ywq157.com/diquan/ba6sfj02nlb.jpg|https://oss.ywq157.com/diquan/p8w3tzyiij9.jpg|https://oss.ywq157.com/diquan/s0tjbdrvedr.jpg|https://oss.ywq157.com/diquan/9vi08ac456.jpg', 'http://www.ajh.com.cn/m/index.php', null, '1', '2019-04-20 17:36:00', '2019-04-23 12:00:17');
