INSERT INTO `company_info` VALUES ('ead69ecc5e67ab9b30b97d1762df66c7', '99754d7a28a062b5f2db3f3a7947505a', '1', '2', '23.15490', '114.41218', '惠州市大容电子科技有限公司', '小金口镇大树岭老虎岭工业区', '惠城区小金口老虎领湖美街38号', '1', '温', '春松', 'https://oss.ywq157.com/diquan/fvv8pjpt8l.jpg', '温春松', 'https://oss.ywq157.com/diquan/6nnc5oi2ze.jpg', 'https://oss.ywq157.com/diquan/aox55c94jdj.jpg', '', '18318824968', '0752-7118285', 'https://oss.ywq157.com/diquan/37nsl95tjys.jpg|https://oss.ywq157.com/diquan/p7dxhjaxzq.jpg|https://oss.ywq157.com/diquan/y0l2qs05vy.jpg|https://oss.ywq157.com/diquan/ois6wzppog.jpg|https://oss.ywq157.com/diquan/iyikbiy3gg.jpg', '贴片SMD0603/0805/1206/1812/2018/2920/DIP系列D16/D30/D60/D250/D72/D265', '惠州市大容电子科技有限公司成立于2011年，专业从事线路防护元器件（PPTC）产品研发，生产和销售，是全球少数掌握聚合物元件核心技术的供应商之一。公司研发队伍在美国以及台湾从事多年PPTC研发以及应用，可提供多种高分子聚合物之可恢复保险丝来满足现在高科技应用上高标准严苛的要求。经由UL认证，大容科技之PPTC产品的长效安全性以及优越使用特性毋庸置疑，自产品设计以及研发开始，遵循ISO9001：2000，及ISO14000之品质管理系统，确保产品的高效品质及一致性。秉持着不断创新与改进，大容电子科技供应之PPTC产能已提升至年产2亿颗，覆盖SMD贴片系列以及DIP插件系列，快速研发与试样，准时以及高品质品质产品出货。世界五百强企业之知名品牌合作伙伴，拥有坚实的财力后盾，高效且经验丰富的生产团队，以及先进的技术为达成弹性与反应速度的需求！海纳百川，有容乃大！大容科技为贵公司可信赖之合作伙伴，我们致力于创造更安全更环保的电子产品造福于人类，以及个性化的专业产品的服务为客户创造价值，与客户共成长，致力于发现为有全球影响力的线路保护产品的供应商。', '惠州市大容电子科技有限公司', 'https://oss.ywq157.com/diquan/swou7zc6j1l.jpg', 'https://oss.ywq157.com/diquan/8i26sj5a0hm.jpg', 'https://oss.ywq157.com/diquan/uso7oqvbtmk.jpg|https://oss.ywq157.com/diquan/6wx25bb9krm.jpg|https://oss.ywq157.com/diquan/871bz2ium37.jpg|https://oss.ywq157.com/diquan/xo3vsdiccnh.jpg|https://oss.ywq157.com/diquan/8cz98rclskm.jpg|https://oss.ywq157.com/diquan/cvysanf6rve.jpg', 'www.rpptc.com', null, '1', '2019-01-07 07:58:08', '2019-01-21 02:49:52');
