INSERT INTO `company_info` VALUES ('ed19f85e7570b66f4a5fa8549f6a43f2', '8c12ae3fe532ba312392dcf0aeb02a7e', '1', '2', '23.44594', '113.50945', '广州市大环臭氧设备有限公司', '太平镇经济开发区振兴路1号', '广东省广州市从化太平经济开发区创新产业园振兴路1号', '2', '朱', '玲玲', 'https://oss.ywq157.com/diquan/wzanteccui.jpg', '朱玲玲', '', '', '', '18928712927', '18928712927', 'https://oss.ywq157.com/diquan/j8wgq0ge6p.jpg|https://oss.ywq157.com/diquan/s3nm4gjz1x9.jpg|https://oss.ywq157.com/diquan/mlwmmyk982.jpg|https://oss.ywq157.com/diquan/44h9oi7afyi.jpg|https://oss.ywq157.com/diquan/hph981u64hf.jpg|https://oss.ywq157.com/diquan/biae718wrxt.jpg|https://oss.ywq157.com/diquan/i28jm3ajmo.jpg|https://oss.ywq157.com/diquan/0d5zvuf1a2an.jpg|https://oss.ywq157.com/diquan/2x2vhi8iz3x.jpg|https://oss.ywq157.com/diquan/36bwowxn3ij.jpg', '臭氧发生器,臭氧消毒机,臭氧机,海洋馆臭氧发生器,泳池臭氧发生器,污水处理臭氧发生器,空间消毒臭氧发生器', '广州市大环臭氧设备有限公司（BNP 0ZONE），成立于1998年,是专业从事臭氧技术研究、开发、臭氧系统设计、制造和服务的公司。广州大环臭氧是臭氧发生器厂家，主要产品有海洋馆臭氧发生器、污水处理臭氧发生器、泳池臭氧发生器、空间消毒臭氧发生器。\n一直致力于臭氧技术的产业化和技术创新。长期为饮用水处理、中水回用处理、化妆品容器消毒杀菌、水产养殖增氧消毒杀菌、家禽养殖业、游泳池水消毒杀菌、无菌车间、制药厂及食品厂消毒杀菌、GMP认证、食品保鲜储藏、果蔬农药降解、污水处理（医院、食品厂、电镀厂等工业污水及城市污水深度处理）工业废气脱臭处理等客户提供专业化服务。得到众多用户的首肯与赞誉！ ', '广州市大环臭氧设备有限公司', 'https://oss.ywq157.com/diquan/buatzp3fa0s.jpg', 'https://oss.ywq157.com/diquan/ejxdqe98967.jpg', 'https://oss.ywq157.com/diquan/etgtv736k47.jpg|https://oss.ywq157.com/diquan/pqwalluzms.jpg|https://oss.ywq157.com/diquan/dal5ql2pdio.jpg|https://oss.ywq157.com/diquan/3tqcmu8bbh5.jpg|https://oss.ywq157.com/diquan/4xthw5hjvvw.jpg|https://oss.ywq157.com/diquan/7p3oglyasq8.jpg|https://oss.ywq157.com/diquan/ucj41co89b.jpg|https://oss.ywq157.com/diquan/byjsfums71.jpg|https://oss.ywq157.com/diquan/efo359rf37.jpg', 'www. bnpozone. com', null, '1', '2019-02-27 03:21:11', '2019-02-27 03:48:54');
