INSERT INTO `company_info` VALUES ('f5cac0ff57f09592209266b3e0906ede', 'ed0711c589e20c4bcd3f53b7b59986a2', '1', '2', '22.71946', '113.90647', '', '广东省深圳市光明区光明新区公明街道田寮社区锦田湾大厦2-3层', '广东省深圳市光明新区田寮怡景工业城b9栋3楼', '1', '王', '伟', 'https://oss.ywq157.com/diquan/zv8e4vq3iob.jpg', '王伟', '', '', '', '13077899498', '0755-27601606', 'https://oss.ywq157.com/diquan/m72yfy8e018.jpg|https://oss.ywq157.com/diquan/bu3odcknclc.jpg|https://oss.ywq157.com/diquan/lk2ddnlolqc.jpg|https://oss.ywq157.com/diquan/hvlrtwzk4je.jpg|https://oss.ywq157.com/diquan/5z84jlh23bf.jpg|https://oss.ywq157.com/diquan/f8qt2cxyb2m.jpg|https://oss.ywq157.com/diquan/rk1fdt9nqr.jpg|https://oss.ywq157.com/diquan/hf5wtmg8g3f.jpg|https://oss.ywq157.com/diquan/20f6086iozi.jpg|https://oss.ywq157.com/diquan/7jf7818f2tw.jpg', '连接器,接插件,排针,排母,简牛,牛角', '深圳市创辉诚科技有限公司成立于2004年,公司自建厂以来公司一直致力于板对板，线对板连接器的研发、生产与销售,主要产品有排针、排母,简牛、牛角，圆针、圆孔IC插座，接线端子台以及其它各类连接器。产品广泛应用于工业控制系统、程控交换机、电脑、电源、显示器(屏)、仪器仪表、安防、汽车、照明、数码电器、机顶盒、电话机、手机等领域。\r\n公司拥有一支技术先进、技能精湛的产品研发与生产团队。目前公司已形成了自动化装配及检测于一体的完整生产链。公司配备有行业各类先进的检测仪器设备,所有产品均符合相关质量标准。我们的产品已销至中国大陆、香港、台湾、欧洲、美洲、中东、东南亚等国内外市场，并与很多国内外知名企业建立了长期稳定的合作伙伴关系。\r\n诚信,专业,品质,服务是我们的经营宗旨。不断打造“NICETYCONN”品牌,培养并巩固与客户之间的相互依存关系,为客户的发展壮大提供各种支持,并借此提高和发展自己,是我们的奋斗目标！\r\n热忱欢迎新老客户垂询并开展合作！', '深圳市创辉诚科技有限公司', 'https://oss.ywq157.com/diquan/5adavyu2my2.jpg', 'https://oss.ywq157.com/diquan/kaxqnihv6c.jpg', 'https://oss.ywq157.com/diquan/pmf5waiwbt9.jpg|https://oss.ywq157.com/diquan/b398m9a1ca.jpg|https://oss.ywq157.com/diquan/kvnqpzrumkk.jpg|https://oss.ywq157.com/diquan/srvxw7w7nik.jpg|https://oss.ywq157.com/diquan/rsw6jq7imy.jpg|https://oss.ywq157.com/diquan/oyd75stpyy.jpg|https://oss.ywq157.com/diquan/djprnpk2bh.jpg|https://oss.ywq157.com/diquan/r88gdq0auz8.jpg|https://oss.ywq157.com/diquan/883euaktnef.jpg|https://oss.ywq157.com/diquan/76zs0tng1ws.jpg', 'www.nicetyconn.com', null, '1', '2019-03-04 05:28:16', '2019-03-22 06:49:47');
