INSERT INTO `company_info` VALUES ('f921202ba3495e8344da2791dda9d4c0', 'c1d60e1878ff93cf81cb1d1476116a46', '1', '1', '30.70751', '114.33174', null, '湖北省武汉市黄陂区 ', '武汉市黄陂区汉口北大道', '1', '付', '贞', 'https://oss.ywq157.com/diquan/op62rlz2nn.jpg', '付贞', null, null, null, '13871209322', '13871209322', null, '安防门禁|监控|停车场|可视对讲|综合布线', '武汉卓思德禄智能科技有限公司是一家集设计、施工、维护服务于一体的智能化高新技术企业。公司依托稳定的产品和先进的技术优势，秉承“技术领先、创新为本、持续发展、服务至上”的经营理念，在强大市场竞争中脱颖而出，成为智慧城市行业的发展典范。公司经营范围：“智慧城市咨询规划、楼宇智能化工程、智慧安防系统工程、智慧校园系统工程、智慧会议系统工程、LED显示屏工程、综合布线工程及智能化产品销售”。自公司成产以来，公司一直以高质量的施工、周到的技术服务和专业的经营理念，赢得广大客户信任和大力支持。\n卓思德禄智能在完善的管理制度与体制下，公司倡导“以人为本、服务社会”的企事业精神，一贯坚持“质量第一、用户至上”的经营理念，注重人才的培养、实践并组建成一支积极进取、技术过硬的精英团队。公司广聚人才，抬贤纳仕，高薪招聘和培养了一批高素质的优秀人才，现拥有一批高、中级工程技术人员和高级管理人员，为客户提供从设计咨询，施工调试到维修保养一站式服务。同时在众多工程和技术的积累下，我们在弱电技术、机电安装、结合布线、LED亮化工程、楼宇对讲系统工程等方面取得了很好的成绩并树立了良好的公司形象和品牌形象。\n我们同心协力，务实创新；优质的信誉、卓越的产品、过硬的团队、高品质的服务，不追求高价格，但求高质量。始终坚持“质量第一，安永至上”的原则，坚持科学管理和技术创新，为用户提供一流的工程质量和性能运行可靠的产品。我们会抓住机遇，开拓进取，面向未来，共创更加辉煌的明天。', '武汉卓思德禄智能科技有限公司', 'https://oss.ywq157.com/diquan/6j0meme1t92.jpg', 'https://oss.ywq157.com/diquan/cfydomaqqv.jpg', null, 'www.whzsdl.com', null, '1', '2019-04-15 09:10:51', '2019-04-15 10:17:08');
