INSERT INTO `company_info` VALUES ('fbc817aa0ce25102b2514adcd9b9da11', 'a4543e474bf64fb0aef9332c78e977f8', '0', '0', '22.71239', '113.85637', null, '广东省深圳市宝安区上南东路123号', '深圳市宝安区沙井镇沙井街道上南东路新丰泽工业园A栋', '0', '徐', '富乐', 'https://oss.ywq157.com/diquan/w5kbv7jelmq.jpg', '徐富乐', 'https://oss.ywq157.com/diquan/sa8p4c6z83.jpg', 'https://oss.ywq157.com/diquan/g3vszje647.jpg', null, '18675224145', '18675224145', 'https://oss.ywq157.com/diquan/znn2hz1rg2r.jpg|https://oss.ywq157.com/diquan/s2pixmo4qck.jpg', '智能家居,智能安防,摄像头,智能锁,可视门铃,智能锁', '深圳市亿联智能有限公司，国家高新技术企业、双软企业、电子商会常务理事单位、中国机电进出口商会会员企业，一直致力于智慧家庭终端产品的研发、生产和销售，已在三网融合、智慧家庭、物联网等领域取得较为瞩目的成绩。公司深圳生产基地占地16000平方米，拥有数十条高速生产线和自动插件线以及配套的生产和工艺设施，1200多名生产和工艺骨干 多数具有数年智慧家庭产品以上的相关经验，每天产能可达80000台智慧终端产品，另亿联巨资在安徽省兴建了13万平方米的智能终端产品工业园，引进最先进的生产系统，打造日产能超过20万台的专业智能终端产品生产基地。。\n\n亿联在深圳、合肥、迪拜、天津、韩国等多地设立研发中心，累计研发人员将近300人，并与南开大学、清华大学开展产学研合作。亿联每年拿出公司利润的20%作为研发经费投入到创新研发工作上，目前已取得几十项自主知识产权，多个项目获得深圳市科技创新委会和新兴产业发展组、深圳经信委审定，获深圳市财政委员会战略新兴产业领域资助。以质量求生存，在体系管理上通过了ISO9001国际质量体系认证、ISO14001环境管理体系认证、GB/T18001职业健康安全管理体系认证等各种认证，产品上通过了CCC、CE、ROSH、FCC、SGS等各项产品认证，为产品质量上提供有力的保证。\n\n亿联以客户需求为导向、持续创新、快速响应，以建立技术和市场方面的战略联盟，研发新的智能控制技术，进入新的市场。公司积极开展海内外市场，每年定期参与美国CES、德国IFA、迪拜Cabsat、巴西FIEE、荷兰IBC、南非Johnnesburg、俄罗斯EXPO、中国广交会、香港电子展、中国CCBN等相关行业展会，并在南美、东南亚、非洲、中东和欧洲设立了办事处。公司自成体系的销售队伍及遍布海内外的办事处和完善的代理销售网络，已将公司的产品销往全球60多个国家和地区。', '深圳市亿联智能有限公司', null, null, null, 'www.elinksmart.com', null, '1', '2019-04-12 17:19:14', '2019-04-16 10:07:48');
