INSERT INTO `company_info` VALUES ('fc067c0c60647df03234dc8d1a753c7b', '1cdafbd1fed2142c8796b99546ddecf9', '1', '2', '22.64701', '114.09184', '茂和兴精密机械有限公司', '坂田街道布吉镇坂田上雪科技园东区10号H栋一楼', 'H栋6楼', '1', '杨', '先林', 'https://oss.ywq157.com/diquan/839mvd1i7p.jpg', '杨先林', 'https://oss.ywq157.com/diquan/v1ynu8srqxg.jpg', 'https://oss.ywq157.com/diquan/lpm0z90yvjp.jpg', '', '15858302366', '15858302366', 'https://oss.ywq157.com/diquan/h8ol63qla7.jpg|https://oss.ywq157.com/diquan/g5cwqbdbpad.jpg|https://oss.ywq157.com/diquan/komvqd65uu8.jpg|https://oss.ywq157.com/diquan/czqwo55oym.jpg|https://oss.ywq157.com/diquan/49uzzmwt11u.jpg|https://oss.ywq157.com/diquan/xkhefj0fs0d.jpg|https://oss.ywq157.com/diquan/vc4c7tp4ojp.jpg|https://oss.ywq157.com/diquan/njekxlj6hx.jpg|https://oss.ywq157.com/diquan/bkikjk614mw.jpg|https://oss.ywq157.com/diquan/1t6hjqcdkwi.jpg', '警用装备   /执法仪   /采集站   /移动电源', '         深圳市达城威电子科技有限公司创立于2013年，注册资本1100万人民币，工厂面积达3000多平方米，是一家技术领先、专业从事移动警用设备及4G无线传输终端产品，集研发、生产、销售及售后服务为一体的国家级高新技术企业，先后通过了ISO9001、ISO14001、OHSAS18001、CCC、FCC、CE、ROHS等认证。\n        目前，公司主要生产单警执法视音频记录仪、4G执法记录仪、数据采集工作站、车载系统、4G平台、摄录手电筒、摄录头灯等产品，多款执法记录仪均已通过国家公安部检测机构认证，获得多项外观专利和研发专利；拥有高效的研发团队、专业的销售队伍、优质的售后服务、无尘生产车间、以及严格的检测标准，并已建成覆盖全国的销售网络，为公安、检察、司法、武警、交通、海事、城管、卫生、工商等执法部门和国外执法人员提供更专业更便利的执法设备，坚持“以客户为中心”，为客户提供高品质的产品及服务。\n        公司未来将继续进行研发和创新，将执法信息从单一的使用模式向网络化、智能化、系统化转变，依托先进的云计算存储和大数据处理技术，连接智能化移动执法系统，与时俱进，持续创新，努力为构建平安智慧城市做出贡献，奋力推进中国执法信息系统化的建设和发展。', '深圳市达城威电子科技有限公司', 'https://oss.ywq157.com/diquan/syop49s8eg.jpg', 'https://oss.ywq157.com/diquan/ceel5y88n4g.jpg', 'https://oss.ywq157.com/diquan/ap8znnv6go5.jpg|https://oss.ywq157.com/diquan/to4oqvp9d2c.jpg', 'http://www.dachengwei.com/', null, '1', '2019-01-04 10:16:06', '2019-01-07 08:08:41');
