INSERT INTO `job_info` VALUES ('69e657af5b0a9cbfb8bec49a2c699f85', null, '22.66702', '114.05300', '雪象花园新村篮球场旁边', '深圳市龙华区观湖街道', '一、职位: 采购专员\n任职要求：\n1.具有蓝牙耳机行业2年以上采购工作经验优先。\n2.熟悉蓝牙耳机常用物料（结构件、电子料、电池、喇叭、线材等）的成本、供应商资源开发导入经验。\n3.熟悉采购的工作流程，具有costdown、商务谈判推动经验。\n4.具有项目性工作推动经验，能够独立统筹新项目在组织内的执行。\n\n二、职位: 蓝牙耳机维修\n任职要求：\n1.初中以上文化，身体健康，视力1.0以上。\n2.认识电子元器件，会焊接，贴片，装配，有电子厂工作经验。\n3.为人诚恳实干、勤快，吃苦耐劳，团结协作的精神。有上进心;。\n4.诚心招聘熟练的焊锡工，非熟练非吃苦耐劳者勿投。\n\n三、职位:生产PMC\n任职要求：\n1、有3年以上电子或电器厂PMC管理工作经验，蓝牙耳机、蓝牙音箱制造企业经历佳。\n2、具有良好的语言表达能力，沟通组织安排，协调能力强。\n3、具备较高的成本意识排单、跟单、物控操作能力。\n4、熟悉生产运作流程及PMC运作流程，必须懂ISO。\n5、抗压性强，坚持不懈，富进取精神，具备较强的统筹能力。\n6、能适应加班；\n四、职位:仓库管理\n任职要求：\n1. 有工厂或者电商仓库打包相关工作经验者优先\n2. 初中以上学历，年龄18-40，男女不限\n3. 品行端正，吃苦耐劳，踏实肯干，有责任心，工作细心负责\n4. 接受领导工作安排，能接受偶尔加班\n5. 会简单的电脑操作\n\n五、职位:电商专员\n岗位责任：\n1、负责店铺的日常销售和管理工作，制定产品营销计划，上传产品、优化产品、站内引流以及广告的投放与调控，维护和管理账号安全（会站外引流优先）；\n2、熟悉运用Amazon平台规则及促销推广方法，根据产品的销售与排名变化,及时制定和调整产品的销售政 策和推广计划，做好数据的统计分析工作；\n3、制定和完善店铺的销售政策与售后服务,提高店铺和链接的好评率与品牌的提升打造；\n4、负责及时回复客户邮件，有效处理客户问题，包括售前咨询、销售跟踪、售后维护以及妥善处理各种争议、投诉等，不断提升销量。\n\n职位要求：\n1.全日制大专以上学历，英语或国际贸易等相关专业;英语CET4以上，有Amazon平台至少一年以上经验.英语听说读写流利.\n2.熟悉亚马逊北美站/欧州站平台等相关政策，熟悉FBA操作，熟悉Amazon各种规则及推广工具的使用，熟 悉亚马逊平台产品上传规则、技巧、交易流程,扩大交易量的方法和技巧，能独立操作。\n3.熟练使用社交软件： Facebook， tweeter， pintresss, blogger 等。\n4. 有团队精神和服务意识，工作主动性强，有责任心；工作认真仔细,有耐心，做事脚踏实地，较强的学习能力、应变能力。\n\n\n六、职位:业务员\n任职要求：\n1：一年以上蓝牙耳机销售经验，能力优秀者可接受应届毕业生\n2：良好的沟通和团队合作精神。\n3：较强的业务扩展能力与坚持不懈的韧性。\n4：具有出色的沟通、表达能力，良好的客户服务意识。\n5：勤快肯学，听从领导指挥。\n6：男女不限\n\n\n\n弘煜电子期待您的加入!\n\n深圳市龙华区观湖街道 南大富社区虎地排88号成裘工业园 1号产房3楼B区      王总：13631591531\n可以帮我操作一下吗？我手机操作搞不好呢 ', null, '采购文员，维修工程师，生产PMC，仓库管理', '面议', '13631531531', '13631591531', '王总', '1', '0', '31a96dd8c8b37c1b3d504748a6a02c1e', '2019-04-15 17:38:49', '2019-04-15 17:38:57');
