INSERT INTO `market_marquee_info` VALUES ('a70e8ac84a78f5235e0ad597c688bd31', null, '<p>3分钟前 深圳 王先生申请了<span style=\"color: #ff6600;\">5</span>款产品下款了<span style=\"color: #ff6600;\">3</span>个</p>', '10', '100', '100', '2', '8d7cad07e2ef31800c49dce8f347fa47', '第二条', '1', '0', '1', '2019-06-17 18:18:34', '2019-06-18 15:52:28');
