INSERT INTO `market_news_info` VALUES ('56bf32189df546c25a74cf0daab6e42d', 'https://oss.ywq157.com/diquan/1555594439813.jpg', '<p>2019年3月8日，深圳市江西彭泽商会第一届第二次会员代表大会暨一周年庆典，在深圳麒麟山庄如期举行。</p>\n<p>&nbsp;</p>\n<p>&nbsp; &nbsp;大会召开前，播放了商会历时半年拍摄的宣传片，短短几分钟的片段，深深触动了在外打拼的彭泽游子之心，这里凝聚了乡情，乡音和浓浓的爱，至此我们在深圳有了自己的家-深圳彭泽商会。</p>\n<p>&nbsp;</p>\n<p><iframe class=\"video_iframe wx_video_iframe\" src=\"https://mp.weixin.qq.com/cgi-bin/readtemplate?t=tmpl/video_tmpl&amp;vid=f08433y64oo\" width=\"556\" height=\"313\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\" data-vidtype=\"1\" data-cover=\"http%3A%2F%2Fshp.qpic.cn%2Fqqvideo_ori%2F0%2Ff08433y64oo_496_280%2F0\" data-ratio=\"1.7777777777777777\" data-w=\"864\" data-mce-fragment=\"1\"></iframe></p>\n<p>&nbsp; &nbsp; &nbsp; &nbsp;</p>\n<p>&nbsp; &nbsp; &nbsp;接着商会创始会长李必旺先生在致辞中表示商会成立这一年是蹒跚学步的一年，是点滴成长和进步的一年。他希望全体会员能为商会的发展积极建言献策，群策群力，共同搭建好这个平台，为在外打拼的彭泽家人提供更完善的服务。为商会及各企业更加辉煌的明天共同奋斗。&nbsp; &nbsp;</p>\n<p>&nbsp;</p>\n<p><img class=\"\" src=\"https://mmbiz.qpic.cn/mmbiz_jpg/XJYudxicMC18q0UcjRatrjCaR4Aluql9dYuAxFyPNIGo7qiaTMWcCIX30PFibLK21icR0Jz22mR2KpT6uBib0V2Aehw/640?wx_fmt=jpeg\" data-backh=\"370\" data-backw=\"415\" data-before-oversubscription-url=\"https://mmbiz.qlogo.cn/mmbiz_jpg/XJYudxicMC18q0UcjRatrjCaR4Aluql9dYuAxFyPNIGo7qiaTMWcCIX30PFibLK21icR0Jz22mR2KpT6uBib0V2Aehw/0?wx_fmt=jpeg\" data-croporisrc=\"https://mmbiz.qpic.cn/mmbiz_jpg/XJYudxicMC18q0UcjRatrjCaR4Aluql9dMTwszNsGa9tRBO1HU550jgEQWmQo9a5LJKIwhUqtiaR6EA1joic3p1Og/0?wx_fmt=jpeg\" data-cropx1=\"324.60431654676256\" data-cropx2=\"1280\" data-cropy1=\"0\" data-cropy2=\"854.1007194244604\" data-ratio=\"0.8922594142259415\" data-s=\"300,640\" data-type=\"jpeg\" data-w=\"956\" /></p>\n<p>&nbsp; &nbsp; &nbsp; &nbsp;李必旺会长致辞</p>\n<p>&nbsp;</p>\n<p>&nbsp; &nbsp; &nbsp;&nbsp;县委常委、统战部部长马亮先生，代表家乡政府对商会表示祝贺，同时对商会也提出了新的期望，期望彭泽商会越办越好！</p>\n<p><img class=\"\" src=\"https://mmbiz.qpic.cn/mmbiz_jpg/XJYudxicMC18q0UcjRatrjCaR4Aluql9dUIlGib5iaQiaS59tNJ4mv77U09drzRdFefcw05dJulJ6MicPHxV1aicWG9g/640?wx_fmt=jpeg\" data-copyright=\"0\" data-ratio=\"0.66640625\" data-s=\"300,640\" data-type=\"jpeg\" data-w=\"1280\" /></p>\n<p>&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;县委常委、统战部部长马亮致辞</p>\n<p>&nbsp;</p>\n<p>&nbsp; &nbsp; &nbsp;随后，商会监事长许智勇先生为商会过去一年的监事工作在大会上做了总结报告，他表示，近一年来商会的财务制度不断完善，商会支出始终坚持节俭、合理、规范的原则。希望未来监事会继续努力，切实履行监督职能，为商会规范运作和健康发展作出积极的贡献。</p>\n<p>&nbsp;</p>\n<p><img class=\"\" src=\"https://mmbiz.qpic.cn/mmbiz_jpg/XJYudxicMC18q0UcjRatrjCaR4Aluql9dcQkNaozC85m1aYUZq033sZiaM9hm2zhJ5aVPh4KwwBz0zKLCkyV33iaw/640?wx_fmt=jpeg\" data-copyright=\"0\" data-ratio=\"0.66640625\" data-s=\"300,640\" data-type=\"jpeg\" data-w=\"1280\" /></p>\n<p>商会监事长许智勇做总结报告</p>\n<p>&nbsp;</p>\n<p>&nbsp; &nbsp;为积极响应社会组织管理局《关于加强异地商会党建工作的文件精神》文件，常务副会长宋继忠先生在大会上汇报了商会党建工作的情况，引导会员们积极将党组织关系转到工作地深圳。为商会党建工作尽早开展一起努力。</p>\n<p>&nbsp;</p>\n<p><img class=\"\" src=\"https://mmbiz.qpic.cn/mmbiz_jpg/XJYudxicMC18q0UcjRatrjCaR4Aluql9dU6K5c7lQFGATFiasnvKps892YG5jWvXpB1tCRpuJvMYcBpdQZiaScm1w/640?wx_fmt=jpeg\" data-copyright=\"0\" data-ratio=\"0.66640625\" data-s=\"300,640\" data-type=\"jpeg\" data-w=\"1280\" /></p>\n<p>常务副会长宋继忠发言</p>\n<p>&nbsp;</p>\n<p>&nbsp; &nbsp;&nbsp;接下来秘书长李永科先生在会上汇报了商会上一年工作总结及2019年商会工作计划。</p>\n<p>&nbsp;</p>\n<p><img class=\"\" src=\"https://mmbiz.qpic.cn/mmbiz_jpg/XJYudxicMC18q0UcjRatrjCaR4Aluql9dS6YXsbXvd9MubkgOBZpQribbMOliaoqsQ8k0iczT927t27zC8hfuR3rPQ/640?wx_fmt=jpeg\" data-copyright=\"0\" data-ratio=\"0.66640625\" data-s=\"300,640\" data-type=\"jpeg\" data-w=\"1280\" /></p>\n<p>商会秘书长李永科做工作报告</p>\n<p>&nbsp;</p>\n<p>&nbsp; &nbsp; &nbsp;大会还为过去一年商会工作过程中，先进个人及优秀团队进行表彰和颁奖。</p>\n<p>&nbsp;</p>\n<p><img class=\"\" src=\"https://mmbiz.qpic.cn/mmbiz_jpg/XJYudxicMC18q0UcjRatrjCaR4Aluql9dVd8dGdWcNMuJeOAcAkYch4jtdbJShkFzUKOg6YcTiaHZib9Bic2zX4DIg/640?wx_fmt=jpeg\" data-copyright=\"0\" data-ratio=\"0.66640625\" data-s=\"300,640\" data-type=\"jpeg\" data-w=\"1280\" /></p>\n<p>&nbsp; &nbsp; &nbsp; &nbsp;县委常委、统战部长马亮先生，会长李必旺先生为副会长、东区片区长范学兵先生颁发优秀片区长奖杯并赠送鲜花和现金奖励。</p>\n<p>&nbsp;</p>\n<p><img class=\"\" src=\"https://mmbiz.qpic.cn/mmbiz_jpg/XJYudxicMC18q0UcjRatrjCaR4Aluql9dL4qXkIB2ZNIKWJK1TXdook6eYicsIfxWosJF64YalicZeeEYiaScnGbyA/640?wx_fmt=jpeg\" data-croporisrc=\"https://mmbiz.qpic.cn/mmbiz_jpg/XJYudxicMC18q0UcjRatrjCaR4Aluql9dqhRBJ0pPsCT85oMR2QMpGgicEEia7VibiafTHicUHNoAnAMpLzYuND9YjDw/0?wx_fmt=jpeg\" data-cropx1=\"0\" data-cropx2=\"1280\" data-cropy1=\"413.39712918660285\" data-cropy2=\"1917.7033492822966\" data-ratio=\"1.17421875\" data-s=\"300,640\" data-type=\"jpeg\" data-w=\"1280\" /></p>\n<p>优秀片区长范学兵发表获奖感言</p>\n<p>&nbsp;</p>\n<p><img class=\"\" src=\"https://mmbiz.qpic.cn/mmbiz_jpg/XJYudxicMC18q0UcjRatrjCaR4Aluql9dBb621yY4B3yOUncdupUibwU7oeic1BYdI8cH6EQFbLz62kA2nMwk9lWQ/640?wx_fmt=jpeg\" data-copyright=\"0\" data-ratio=\"0.66640625\" data-s=\"300,640\" data-type=\"jpeg\" data-w=\"1280\" /></p>\n<p>常务副会长宋继忠先生为优秀片区-东区颁发奖杯。</p>\n<p>&nbsp;</p>\n<p><img class=\"\" src=\"https://mmbiz.qpic.cn/mmbiz_jpg/XJYudxicMC18q0UcjRatrjCaR4Aluql9doFWTfeqD5Hg9VIO8nuAhaw7M6FTEdJiabuic9NUMJ042VmjfUgOo27yg/640?wx_fmt=jpeg\" data-copyright=\"0\" data-ratio=\"0.66640625\" data-s=\"300,640\" data-type=\"jpeg\" data-w=\"1280\" /></p>\n<p>&nbsp; &nbsp; &nbsp;县委常委、统战部长马亮先生为获得商会突出贡献奖的领导颁发奖杯，他们在百帮中抽出时间为商会的各项活动牵线搭桥，组织策划，亲力亲为为会员解决困难。他们是会长李必旺（左三）、监事长许智勇（左二）、常务副会长宋继忠（右二），南区片区长季益华（右一），北区片区长王国福（左一）</p>\n<p>&nbsp;</p>\n<p><img class=\"\" src=\"https://mmbiz.qpic.cn/mmbiz_jpg/XJYudxicMC18q0UcjRatrjCaR4Aluql9dfaZEDwXvuQ9sG4fkJIwZU3WjwpYcF0gt09WsOF4I8SiaGODq3sfX4Lw/640?wx_fmt=jpeg\" data-copyright=\"0\" data-ratio=\"0.66640625\" data-s=\"300,640\" data-type=\"jpeg\" data-w=\"1280\" /></p>\n<p>突出贡献奖代表季益华片区长发表获奖感言</p>\n<p>&nbsp;</p>\n<p><img class=\"\" src=\"https://mmbiz.qpic.cn/mmbiz_jpg/XJYudxicMC18q0UcjRatrjCaR4Aluql9dPWCgWfWPwBkjXB1apkRkAGrwyOXNxA3bclW2OZkMhfhTuz92V5fpcA/640?wx_fmt=jpeg\" data-copyright=\"0\" data-ratio=\"0.66640625\" data-s=\"300,640\" data-type=\"jpeg\" data-w=\"1280\" /></p>\n<p>&nbsp; &nbsp; &nbsp;李必旺会长为获得商会组织建设贡献奖人员颁发奖杯，他们作为理事会成员为商会团队建设出谋划策，贡献力量，为商会的发展发挥了积极的作用。从左依次为：常务副会长江源、副会长刘月霞、常务副会长陈昌寿、监事王金初、副会长柯琪瑞、理事詹金鹏、柯新标、黄飞，常务理事吴明奎、理事王槐庭。</p>\n<p>&nbsp;</p>\n<p><img class=\"\" src=\"https://mmbiz.qpic.cn/mmbiz_jpg/XJYudxicMC1icDfqad9rHMTXFmTiaUNEQDNlBYkiaxP1CZFNZmRmrUOFksHB5odez6O88Dic9thyIyAKOB4tFhs7BwA/640?wx_fmt=jpeg\" data-copyright=\"0\" data-ratio=\"0.66640625\" data-s=\"300,640\" data-type=\"jpeg\" data-w=\"1280\" /></p>\n<p>组织建设贡献奖代表刘月霞副会长发表获奖感言</p>\n<p>&nbsp;</p>\n<p><img class=\"\" src=\"https://mmbiz.qpic.cn/mmbiz_jpg/XJYudxicMC18q0UcjRatrjCaR4Aluql9dAEJb20VwDibruqibsE3NkZ8ByEVgjcVqcict1xY63LCGB9JLZXLxtQzxg/640?wx_fmt=jpeg\" data-copyright=\"0\" data-ratio=\"0.66640625\" data-s=\"300,640\" data-type=\"jpeg\" data-w=\"1280\" /></p>\n<p>&nbsp; &nbsp; &nbsp;许智勇监事长为获得商会优秀服务奖人员颁发奖杯，这是一支志愿者队伍，从商会成立以来，每一次活动都有他们为大家服务的身影，他们默默付出，无私奉献。左起为会员齐德盈、吴东针、石海俊、吕汉超、齐永兵、韩宋、吕艺生、魏刚、付海权。</p>\n<p>&nbsp;</p>\n<p><img class=\"\" src=\"https://mmbiz.qpic.cn/mmbiz_jpg/XJYudxicMC18q0UcjRatrjCaR4Aluql9dia9q6HkmoszHJGStgOwDa9LRUpekvoicTuiajY9U283RRNwZe4DStl3ag/640?wx_fmt=jpeg\" data-copyright=\"0\" data-ratio=\"0.66640625\" data-s=\"300,640\" data-type=\"jpeg\" data-w=\"1280\" /></p>\n<p>获奖代表韩宋发表感言</p>\n<p>&nbsp;</p>\n<p><img class=\"\" src=\"https://mmbiz.qpic.cn/mmbiz_jpg/XJYudxicMC18q0UcjRatrjCaR4Aluql9d7WU5UlQkcpTp86vMSVG6pTKicnamf3BoaCebgBDdA2AsDap6eiarcqsA/640?wx_fmt=jpeg\" data-copyright=\"0\" data-ratio=\"0.66640625\" data-s=\"300,640\" data-type=\"jpeg\" data-w=\"1280\" /></p>\n<p>&nbsp; &nbsp;&nbsp;宋继忠常务副会长为获得商会优秀会员奖人员颁发奖杯，优秀会员们通过商会搭建的平台，利用自己的专业知识为会员培训、服务，积极参加商会举办的各项活动，传播正能量。他们从左依次为会员王竟国、周小刚、王彦根、董彭德、闵继风、吴旭峰、张群华。</p>\n<p>&nbsp;</p>\n<p><img class=\"\" src=\"https://mmbiz.qpic.cn/mmbiz_jpg/XJYudxicMC18q0UcjRatrjCaR4Aluql9dYD7J8ddq1nG25BtOtn11BruE7LjPYibhUTAC5r1rky5SsHWgLs4h9ibA/640?wx_fmt=jpeg\" data-copyright=\"0\" data-ratio=\"0.66640625\" data-s=\"300,640\" data-type=\"jpeg\" data-w=\"1280\" /></p>\n<p>获奖代表董彭德发表感言</p>\n<p>&nbsp;</p>\n<p>&nbsp; &nbsp; &nbsp;最后在全体会员的见证下，李必旺会长为彭泽商会足球队现场授旗。祝愿彭泽商会足球队在未来的赛事中继续发扬努力拼搏的精神，再创辉煌！</p>\n<p>&nbsp;</p>\n<p><img class=\"\" src=\"https://mmbiz.qpic.cn/mmbiz_jpg/XJYudxicMC18q0UcjRatrjCaR4Aluql9d6wlXicYMsTiah5L31hDeggAXiatibeXwY86l9Xf5ubms2FL14Y8blxCwOQ/640?wx_fmt=jpeg\" data-copyright=\"0\" data-ratio=\"0.66640625\" data-s=\"300,640\" data-type=\"jpeg\" data-w=\"1280\" /></p>\n<p>商会足球队人王竟国接受会长授旗</p>\n<p>&nbsp;</p>\n<p>&nbsp; &nbsp; 晚宴环节在优美的开场舞蹈中拉开序幕，会员黄颖带来《三次心跳》，轻柔的音乐、曼妙的舞姿给全场带来了视觉震撼。</p>\n<p>&nbsp;</p>\n<p><img class=\"\" src=\"https://mmbiz.qpic.cn/mmbiz_jpg/XJYudxicMC18q0UcjRatrjCaR4Aluql9dgb5eKFxOgPiagibR3YwWV3OCaARL6icqLp5KrZ7RWBDuwibJt2UEGET1PQ/640?wx_fmt=jpeg\" data-copyright=\"0\" data-ratio=\"0.66640625\" data-s=\"300,640\" data-type=\"jpeg\" data-w=\"1280\" /></p>\n<p>&nbsp; &nbsp;&nbsp;</p>\n<p>&nbsp; &nbsp; 吴东针老师的葫芦丝表演，让人再次聆听美妙的旋律，真是余音绕梁，三日不绝。</p>\n<p>&nbsp;</p>\n<p><img class=\"\" src=\"https://mmbiz.qpic.cn/mmbiz_jpg/XJYudxicMC18q0UcjRatrjCaR4Aluql9dMe2blz7SWnTzic84cxD6XaeyiciauRZemS7cYib5O92dWia8jtmlyhicichyQ/640?wx_fmt=jpeg\" data-copyright=\"0\" data-ratio=\"0.66640625\" data-s=\"300,640\" data-type=\"jpeg\" data-w=\"1280\" /></p>\n<p>&nbsp; &nbsp;</p>\n<p>&nbsp; &nbsp; 张成演唱的《美丽家园》，让人激情澎湃。</p>\n<p>&nbsp;</p>\n<p><img class=\"\" src=\"https://mmbiz.qpic.cn/mmbiz_jpg/XJYudxicMC18q0UcjRatrjCaR4Aluql9dibEvO1vE9unR3TlxncsL5KPB1pq4FdhHrKUuz01OhBwmwdZC1QrfFVw/640?wx_fmt=jpeg\" data-copyright=\"0\" data-ratio=\"0.66640625\" data-s=\"300,640\" data-type=\"jpeg\" data-w=\"1280\" /></p>\n<p>&nbsp; &nbsp; &nbsp; &nbsp;</p>\n<p>&nbsp; &nbsp; &nbsp;张凤，柯丽琴，王金初，王竟国四人朗诵《你还记得我吗》，声情并茂，让人思绪万千，梦回故乡。</p>\n<p>&nbsp;</p>\n<p><img class=\"\" src=\"https://mmbiz.qpic.cn/mmbiz_jpg/XJYudxicMC18q0UcjRatrjCaR4Aluql9d8Js1TPFeXPEt8Q8RgwxOkuYOsm5rHMP1y2joY3pAykvsHEiazc0xzFA/640?wx_fmt=jpeg\" data-copyright=\"0\" data-ratio=\"0.66640625\" data-s=\"300,640\" data-type=\"jpeg\" data-w=\"1280\" /></p>\n<p>&nbsp; &nbsp;&nbsp;</p>\n<p>&nbsp; &nbsp; 乐队及管弦乐表演的小演员们，他们年少的激情，蓬勃的朝气，又唤醒我们曾经青春的节拍。</p>\n<p>&nbsp;</p>\n<p><img class=\"\" src=\"https://mmbiz.qpic.cn/mmbiz_jpg/XJYudxicMC18q0UcjRatrjCaR4Aluql9dibOEQNiardRVpqvF7WgCPOibUqVVUMzKgAWeYT6cWEhfTDiawOyZYnJsSA/640?wx_fmt=jpeg\" data-copyright=\"0\" data-ratio=\"0.66640625\" data-s=\"300,640\" data-type=\"jpeg\" data-w=\"1280\" /></p>\n<p><img class=\"\" src=\"https://mmbiz.qpic.cn/mmbiz_jpg/XJYudxicMC18q0UcjRatrjCaR4Aluql9dLdwaRouqrWWkoWCeLfoILu70GibMu3CeibfgRQqyDvHyJicqYAiagRhRQA/640?wx_fmt=jpeg\" data-copyright=\"0\" data-ratio=\"0.66640625\" data-s=\"300,640\" data-type=\"jpeg\" data-w=\"1280\" /></p>\n<p>&nbsp; &nbsp;&nbsp;</p>\n<p>&nbsp; &nbsp;张译心小朋友表演的《传奇刀马旦》，年少但不轻狂，再现巾帼不让须眉的气概。</p>\n<p>&nbsp;</p>\n<p><img class=\"\" src=\"https://mmbiz.qpic.cn/mmbiz_jpg/XJYudxicMC18q0UcjRatrjCaR4Aluql9ddqiaFDZZGTGqibJrML2Aia3eUcSxlbFjyKbnqyeZibEXUUZ6LicKPFDibUMg/640?wx_fmt=jpeg\" data-copyright=\"0\" data-ratio=\"0.66640625\" data-s=\"300,640\" data-type=\"jpeg\" data-w=\"1280\" /></p>\n<p>&nbsp;</p>\n<p>&nbsp; &nbsp; &nbsp;胡圆演唱的黄梅戏《女驸马》片段，唱腔圆润细腻，表演质朴细致，让远在他乡的我们，能再次享受黄梅戏的熏陶。</p>\n<p>&nbsp;</p>\n<p><img class=\"\" src=\"https://mmbiz.qpic.cn/mmbiz_jpg/XJYudxicMC18q0UcjRatrjCaR4Aluql9dz08gicKvjUBy8BWQnV6vEtBKWiaRMhP8lCaESibsCibmcUqMh3nvYmufrQ/640?wx_fmt=jpeg\" data-copyright=\"0\" data-ratio=\"0.66640625\" data-s=\"300,640\" data-type=\"jpeg\" data-w=\"1280\" /></p>\n<p>&nbsp;</p>\n<p>&nbsp; &nbsp; &nbsp; &nbsp;舒干良的小品和宋杰的《我们不一样》歌曲一度让现场出现尖叫，掌声不断。</p>\n<p>&nbsp;</p>\n<p><img class=\"\" src=\"https://mmbiz.qpic.cn/mmbiz_jpg/XJYudxicMC1icDfqad9rHMTXFmTiaUNEQDNBIIBfbo2SqMpPnticIoZVr4qBf7wNyicq6tqpFjTmiahsuZkeHQ1Umt7Q/640?wx_fmt=jpeg\" data-croporisrc=\"https://mmbiz.qpic.cn/mmbiz_jpg/XJYudxicMC1icDfqad9rHMTXFmTiaUNEQDN2osbGD5k7PxsLnvDUPrG4b9iak2Rwy0ic2wD52rjsWfjblJUg1fGSJyg/0?wx_fmt=jpeg\" data-cropx1=\"0\" data-cropx2=\"1280\" data-cropy1=\"0\" data-cropy2=\"854.1007194244604\" data-ratio=\"0.66640625\" data-s=\"300,640\" data-type=\"jpeg\" data-w=\"1280\" /></p>\n<p><img class=\"\" src=\"https://mmbiz.qpic.cn/mmbiz_jpg/XJYudxicMC18q0UcjRatrjCaR4Aluql9dM6IyVnoU4HBlnWKQV3Y1q3NvicESDcbWibryJAQgHG6KTkxbN2ibthiahw/640?wx_fmt=jpeg\" data-copyright=\"0\" data-ratio=\"0.66640625\" data-s=\"300,640\" data-type=\"jpeg\" data-w=\"1280\" /></p>\n<p>&nbsp;</p>\n<p>&nbsp; &nbsp; &nbsp; 活动过程中，众多的抽奖和游戏环节，让现场的气氛一次次涌向高潮。晚宴在《相亲相爱一家人》的大合唱中圆满结束。</p>\n<p>&nbsp;</p>\n<p><img class=\"\" src=\"https://mmbiz.qpic.cn/mmbiz_jpg/XJYudxicMC18q0UcjRatrjCaR4Aluql9dPZMBqoDBHFIAhlgAevDR8zwOn3pNZfnQa8wI3eeW8icKKEbqIORjMPg/640?wx_fmt=jpeg\" data-copyright=\"0\" data-ratio=\"0.66640625\" data-s=\"300,640\" data-type=\"jpeg\" data-w=\"1280\" /></p>\n<p>&nbsp; &nbsp;</p>\n<p>&nbsp; &nbsp; &nbsp;整场盛会参加人员达300人，有政府领导，特邀嘉宾，新老会员及演艺工作人员。大家齐聚一堂，相谈甚欢。新的一年，新的希望，家在远方，心在一起，深圳彭泽商会将继续坚持&rdquo;以信为本，公平公正，自由平等，合作共赢&rdquo;的核心价值观，共建美好大家庭。</p>\n<p>&nbsp;</p>\n<p><img class=\"\" src=\"https://mmbiz.qpic.cn/mmbiz_jpg/XJYudxicMC18q0UcjRatrjCaR4Aluql9dGxpib9Ck4TCQciabw8HNoIuE5tXgn1IInulfHqmTeQkiaApUy4hN4qk7A/640?wx_fmt=jpeg\" data-copyright=\"0\" data-ratio=\"0.66640625\" data-s=\"300,640\" data-type=\"jpeg\" data-w=\"1280\" /></p>\n<p>&nbsp; &nbsp;&nbsp;</p>\n<p>特别鸣谢为本次周年庆典大力支持的会员单位，他们是：</p>\n<p>深圳建邦建设有限公司&nbsp; &nbsp;</p>\n<p>深圳市裕嘉印刷包装有限公司</p>\n<p>深圳市科特伟业有限公司&nbsp;</p>\n<p>深圳市正天伟科技有限公司&nbsp;&nbsp;</p>\n<p>深圳市天一世纪纸业有限公司</p>\n<p>深圳市奥特高科电子有限公司</p>\n<p>深圳市和睿家俬有限公司</p>\n<p>广东橙果律师事务所</p>\n<p>新联益建材实业（深圳）有限公司</p>\n<p>深圳市沁森园林工程有限公司</p>\n<p>佛山市世昌铝业工程有限公司</p>\n<p>深圳市香巴拉文化艺术传播有限公司</p>\n<p>深圳市兴艺隆纸制品有限公司</p>\n<p>广东普罗米修律师事务所</p>\n<p>深圳市鼎鑫盛光学科技有限公司</p>\n<p>深圳市润泽净化装饰工程有限公司</p>\n<p>深圳市忠科仁电子有限公司</p>\n<p>深圳市亿昕凯电子科技有限公司</p>\n<p>深圳亿鼎冠科技有限公司</p>\n<p>富国（深圳）投资控股有限公司</p>\n<p>深圳市多美隆电子科技有限公司</p>\n<p>深圳市锦泰隆塑胶五金制品厂</p>\n<p>东莞市帝超塑胶有限公司</p>\n<p>深圳市贝利视通科技有限公司</p>\n<p>深圳市丽彩展示设计有限公司</p>\n<p>震宇科技集团</p>\n<p>深圳市亚格家具有限公司</p>\n<p>深圳市广源泰塑胶五金制品有限公司</p>\n<p>深圳市永信建设工程有限公司</p>\n<p>深圳市阜昌技术有限公司</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p><strong class=\"135brush\" data-brushtype=\"text\">促进信息共享、打造百年商会&nbsp;</strong></p>\n<p><img class=\"\" src=\"https://mmbiz.qpic.cn/mmbiz_jpg/XJYudxicMC1icqnLEH96L9XicYqlI9dziadMY6bqoNJ0nbMKu6hqicRa26rE2F26yI6GwLIHWNicPYgpvcicGgUDSDBug/640?wx_fmt=jpeg\" data-copyright=\"0\" data-cropselx1=\"0\" data-cropselx2=\"556\" data-cropsely1=\"0\" data-cropsely2=\"289\" data-ratio=\"0.5203125\" data-s=\"300,640\" data-type=\"jpeg\" data-w=\"1280\" /></p>', '39', '3', '2', null, '“家在远方，心在一起”热烈祝贺深圳市江西彭泽商会第一届第二次会员代表大会暨周年庆典活动圆满举办', null, '1', '0', null, null, null);
