  `fee` decimal(8,0) NOT NULL DEFAULT '0' COMMENT '升级所需价格，单位 分',
  `direct_fee` decimal(8,0) DEFAULT NULL COMMENT '直推返现金额 分',
  `name` varchar(50) DEFAULT NULL COMMENT '等级称呼',
  `description` text COMMENT '描述',
  PRIMARY KEY (`id`),
  UNIQUE KEY `level` (`level`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

